INSERT INTO `articles` VALUES (2,'Home','home','2023-10-18 17:44:17.978000','2024-02-14 12:21:36.512000','2023-10-18 17:48:57.817000',1,1,NULL,'Home','Home'),(3,'About Us','about-us','2024-01-18 09:14:44.351000','2024-02-14 12:46:08.121000','2024-01-18 09:14:47.624000',1,1,'<p>Home purchasing is a strenuous procedure in which you contribute your life long savings. We, at Full Basket Property, understand the value and support you by analyzing your need and then recommending a property. We don\'t just sell property but we help you in fulfilling your dream. At Full Basket Property Services, we comprehend that purchasing or selling a house is something other than a transaction: it\'s an extraordinary affair. Here we influence cutting edge innovation and smart information to manage each home buyer, directly from pursuit till possession. As a digital marketplace with a thorough scope of property listings, our work does not end just at site visits, we help you with home loans and property registrations too. There are numerous valid reasons to work with a certified real estate expert - representing best-in-class buyer services.</p><p>Services We Offer:</p><p>Home Search - Assisting and helping you discover your dream home fitting your needs by giving you information on market trends, legalities, site visit help and so on.<br>Home Loan Assistance - We will remove your agony of going around the banks to get your advance endorsed by giving doorstep administration of brokers of your decision at your place.<br>Property Purchase Assistance - Ensuring that your home purchasing turns into a wonderful encounter, our Relationship Manager will be there all through the procedure of documentation.<br>Post Sales Service – This is the thing that separates us from others. We will be there for all conceivable help and direction till you move into your home.<br>Interior Services - We are tied with best interior architects in the city who give the best designs and execute them at a competitive cost.<br>Full Basket Property Services is one of the quickest developing Realtors in India with expanded interests over the real estate value chain. We began with a dream to revolutionize the Real Estate market and to make a brand picture worldwide through its associations with passionate real estate experts and market pioneers in the real estate business. We help you to choose your ideal home by providing end to end support. We are headquartered in Bangalore with a regional network in Hyderabad, Pune, and Chennai. We are as yet expanding rapidly. We have a notoriety for our expert brilliance in giving an exhaustive arrangement of offers. Our experts value helping all your property needs from purchasing of properties to esteem included administrations extending from monetary arranging, pattern figures, migration and so forth. Working in cooperative energy with them is young talent who soak up a future confronting soul of a start-up. We are driven by the fundamental estimations of consumer loyalty, credibility and professionalism.</p><p>Full Basket Property embodies that soul of high-validity in the pedigree of our pioneers and our committed client driven methodology. We endeavor to be the real estate organization of choice for perceiving clients by offering the best service standards, the most ideal response time and the largest amount of polished skill in our industry. It is our privilege to enable developers to accomplish their yearnings of high and quick deals for their investments and to help our clients in working up their individual property portfolio well ordered from their first dream home to a triumphant investment property.</p><p>Our Vision:&nbsp;<br>Breaking new ground with imaginative, innovation driven solutions to real estate.</p><p>Our Mission:&nbsp;<br>Our theory is clear: clients come first. We vow to be in steady correspondence with our customers, keeping them completely informed all through the whole purchasing or selling process. We don\'t measure success through accomplishments or grants, however through the satisfaction of our customers.</p><p>Our Core Values:</p><p>We endeavor to convey the most elevated administration guidelines in order to accomplish the best results for our clients.<br>At Full Basket Property Services, we strive to have a genuine effect in the real estate market with an affirmation of transparency and quality service.<br>Mindful of the trust our customers place in us, we will be straightforward, honest and upstanding in the entirety of our business dealings.<br>Full Basket Property Services\' real estate partners embrace never to adorn the certainties or distort the expectation of any gatherings in any property transaction.<br>We function and thrive as a group, regarding each other\'s professional skills and inclining towards one another’ qualities.<br>Enable others to be fruitful in their activity and helping our clients to settle on the correct venture choices.<br>Purchasing a house is a crucial investment – transform it into your most secure and best deal at Full Basket Property. Our forte lies in task consultancy and marketing. We help our clients to recognize specific market niches for their venture and cautiously assess economic situations before prescribing the best solution for their property. The present buyers need a confided resource that can direct them through the intricate universe of real estate. By combining free market activity, Full Basket Property is making huge hindrances of passage through scale, sourcing capacities, request accumulation and utilization of innovation to empower multi modular appropriation stage which will help solidify its positioning as a standout amongst the most inventive, biggest and adaptable real estate stages in India. With our extensive learning and commitment to giving just the best and most authentic data to our clients, we are your go-to reference for real estate industry understanding and guidance.</p><p>When you collaborate with Full Basket Property Services you\'ll be served, not sold.</p><p>Learn more about our commitment to provide you with the best real estate support or get in touch to have a chat.</p>','About Us','About Us'),(4,'Terms & Conditions','terms-and-conditions','2024-01-18 09:18:00.314000','2024-02-14 12:46:43.137000','2024-01-18 09:18:02.557000',1,1,'<p>Full Basket Property maintains this Website for your personal use. Your access to and use of this site is subject to the following Terms of Use. Full basket property reserves the right to update the Terms and Conditions at any time without notice to you.</p><p>Full Basket Property strives to ensure that the information contained in this site is accurate and reliable, Full Basket Property makes no warranties or representations as to the accuracy, reliability or otherwise with respect to such information, and assumes no liability or responsibility for any omissions or errors in the content of this Site.</p>','Terms & Conditions','Terms & Conditions'),(5,'Blog','blog','2024-01-21 15:30:56.433000','2024-02-14 12:22:00.247000','2024-01-21 15:32:40.189000',1,1,NULL,'Blogs','Blogs'),(6,'Reviews','reviews','2024-01-21 15:33:13.881000','2024-02-14 12:22:38.766000','2024-01-21 15:33:16.145000',1,1,NULL,'Reviews','Reviews'),(7,'Contact Us','contact','2024-01-21 15:34:59.674000','2024-02-14 12:22:10.152000','2024-01-21 15:35:05.018000',1,1,NULL,'Contact Us','Contact Us'),(8,'Privacy Policy','privacy-policy','2024-01-24 09:51:11.184000','2024-02-14 12:47:09.734000','2024-01-24 09:51:18.403000',1,1,'<p>This Privacy Policy describes how your personal information is collected such as name, e-mail address or phone number, used, and shared when you visit or make a purchase from Full Basket Property</p><p>The User expressly agrees and acknowledges that the company collects and stores the User’s personal information, which is provided by the user from time to time on the Website, including but not limited to the user’s user name, passwords, email address, name, address, age, date of birth, sex, nationality, shopping preferences, browsing history, etc., as well as any images or other information uploaded/published by the user on the website. The user is aware that this information will be used by the company/website to provide services and features targeted at the user, that are most likely to meet the user’s needs, and also to customize and improve the website to make its user’s experiences safer and easier</p><p>When you visit the Site, we automatically collect certain information about your device, including information about your web browser, IP address, time zone, and some of the cookies that are installed on your device. Additionally, as you browse the Site, we collect information about the individual web pages or products that you view, what websites or search terms referred you to the Site, and information about how you interact with the Site. We refer to this automatically-collected information as “Device Information.”</p><p>We collect Device Information using the following technologies:</p><p>“Cookies” are data files that are placed on your device or computer and often include an anonymous unique identifier.<br>“Log files” track actions occurring on the Site, and collect data including your IP address, browser type, Internet service provider, referring/exit pages, and date/time stamps.</p><p>How do we use your personal Information?<br>We use the Information that we collect generally to fulfil any queries placed through the Site. Additionally, we use this Information to communicate with you and when in line with the preferences you have shared with us, provide you with information or advertising relating to our products or services.</p><p>We use the Device Information that we collect to help us screen for potential risk and fraud (in particular, your IP address), and more generally to improve and optimize our Site.</p><p>Sharing Your Personal Information<br>We share your Personal Information with third parties to help us use your Personal Information, as described above.</p><p>Finally, we may also share your Personal Information to comply with applicable laws and regulations, to respond to a subpoena, search warrant or other lawful request for information we receive, or to otherwise protect our rights.</p><p>Behavioural Advertising<br>As described above, we use your Personal Information to provide you with targeted advertisements or marketing communications we believe may be of interest to you.</p><p>Data Retention<br>When you place an enquiry through the Site, we will maintain your Information for our records unless and until you ask us to delete this information.</p>','Privacy Policy','Privacy Policy');
