INSERT INTO `builders` VALUES (16,'Assetz Builder','<p>Assetz Property Group, established in 2006, is a renowned name in the real estate industry. With a strong commitment to quality and innovation, Assetz Property Group has successfully delivered numerous residential and commercial projects. They are known for their attention to detail and customer satisfaction.</p>','2024-01-10 05:10:07.047000','2024-01-10 05:10:10.064000','2024-01-10 05:10:10.061000',2,2,'assetz-builder'),(17,'Urbanrise','<p>Founded by a visionary team of young and passionate experts from the real estate industry, Urbanrise, one of the best builders in Chennai and Hyderabad, is a promising real estate brand emerging across South India from India’s well-acclaimed Alliance Group.</p><p>With 36 Million Sq.Ft of projects worth Rs.14,000 Crores under execution at different stages, Urbanrise projects are funded byADIA (Abu Dhabi Investment Authority) the world’s largest sovereign fund through Kotak Realty Fund and IndoStar Capital Finance Ltd. Urbanrise offers world-class development coupled with complete transparency in operations and ethical practices which is a new benchmark in the industry.</p><p>Our Vision is to be the World’s largest real estate developer with annual revenues of $10 Billion by the year 2035. Thus bringing pride to our country that we have conquered yet another industry.</p>','2024-01-10 10:38:08.458000','2024-01-10 10:38:37.717000','2024-01-10 10:38:15.629000',2,2,'urbanrise'),(18,'Adarsh Group','<p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Since its inception in 1988, under the visionary leadership of Founder Mr. BM Jayeshankar, <a style=\"background-color:transparent;box-sizing:border-box;color:rgb(68, 68, 68);margin-bottom:0px;text-decoration:none;\" target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.adarshdevelopers.com/\">Adarsh Group</a> has experienced phenomenal growth. Started as a humble endeavour, today Adarsh Developers are one of the leading real estate companies in Bengaluru.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Coming to be known now as the innovative creator of a luxurious lifestyle, the group constructed its first residential property in 1996 and after that, there was no looking back. Defining the future of architectural excellence, Adarsh offers an eco-friendly, secure and self-sufficient lifestyle through their numerous Residential and commercial endeavours. Today, Adarsh Developers is a name synonymous with quality.</p>','2024-01-10 15:45:54.340000','2024-01-10 15:46:08.177000','2024-01-10 15:46:08.174000',2,2,'adarsh-group'),(19,'Bhartiya City Group','<p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Being primarily engaged in and exports of leather apparel through a listed entity, Bhartiya Group has been ruling the real estate market since its inception in 2006 of business. They believe in the concept of quality construction which makes it to be the perfect design for a good lifestyle.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:0px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Enhancing the quality of life across the world for over 30 years, this builder has seen a fast pace development offering turnkey building solutions. Led by this simple philosophy, the&nbsp;<a style=\"background-color:transparent;box-sizing:border-box;color:rgb(68, 68, 68);text-decoration:none;\" target=\"_blank\" rel=\"noopener noreferrer\" href=\"http://bhartiyacity.com/category/mayors-blog/\">Bhartiya Group</a>&nbsp;is working on a number of projects delivering quality end-to-end construction services from concept to completion, including project management. And hence, this builder is identified as one of the best one delivering the best of all homes. Explore details of&nbsp;<a style=\"background-color:transparent;box-sizing:border-box;color:rgb(68, 68, 68);text-decoration:none;\" target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.homznspace.com/nikoo-homes-4-bhartiya-city-thanisandra-bangalore/\">Phase 5</a>&nbsp;&amp;&nbsp;<a style=\"background-color:transparent;box-sizing:border-box;color:rgb(68, 68, 68);margin-bottom:0px;text-decoration:none;\" target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.homznspace.com/leela-residences-bhartiya-city/\">Leela Residency.</a></p>','2024-01-10 15:59:04.891000','2024-01-10 15:59:07.861000','2024-01-10 15:59:07.858000',2,2,'bhartiya-city-group'),(20,'Birla Estate','<p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\"><a style=\"background-color:transparent;box-sizing:border-box;color:rgb(68, 68, 68);margin-bottom:0px;text-decoration:none;\" target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.birlaestates.com/\">Birla Estates</a> is the real estate vertical of Century Textiles and Industries Ltd., the over Rs. 8000 crore flagship Company of the B. K. Birla Group of Companies with presence in cement, textiles, rayon yarn, pulp &amp; paper, salt, chemicals and more. Birla Estates will be developing many land parcels that they hold as well as look at joint development/strategic tie-ups across top cities.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">We will transform the perception of Indian Real Estate sector by delivering an exceptional experience and creating value, at every level, for every stakeholder.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">We will provide an iconic brand experience aligned to our legacy by never compromising on transparency, commitment, quality and superior design.</p>','2024-01-10 16:25:49.901000','2024-01-10 16:25:52.685000','2024-01-10 16:25:52.682000',2,2,'birla-estate'),(21,'Brigade Group','<p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">In 1986, we began as a team of five, operating out of a small site office on our first project, with our sole focus being property development. Today, we number well over 500 and operate from plush offices across two floors at the prestigious World Trade Center Bangalore.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Our team of ‘<a style=\"background-color:transparent;box-sizing:border-box;color:rgb(68, 68, 68);margin-bottom:0px;text-decoration:none;\" target=\"_blank\" rel=\"noopener noreferrer\" href=\"http://www.brigadegroup.com/\">Brigadiers</a>’—based in several major cities in South India, Dubai and San Francisco—work across a diverse portfolio of domains and projects, and draw upon a national and international pool of professional associates. To date, we have completed over 100 buildings; worked on numerous interesting projects and initiatives, many of which inhabit realms unrelated to our business; and engaged with the community through a variety of CSR initiatives. In the process, we have earned important certifications, won prestigious awards and created urban landmarks.</p>','2024-01-10 16:37:35.613000','2024-01-10 16:37:45.661000','2024-01-10 16:37:45.657000',2,2,'brigade-group'),(22,'Godrej Properties','<p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Godrej Properties brings the Godrej Group philosophy of innovation, sustainability, and excellence to the real estate industry. Each Godrej Properties development combines a 119–year legacy of excellence and trust with a commitment to cutting-edge design and technology. Godrej Properties is currently developing residential, commercial, and township projects spread across approximately 11.89 million square meters in 12 cities.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">In the last 3 years,&nbsp;<a style=\"background-color:transparent;box-sizing:border-box;color:rgb(68, 68, 68);margin-bottom:0px;text-decoration:none;\" target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.godrejproperties.com/\">Godrej Properties</a> has received over 150 awards and recognitions, including the “Real Estate Company Of The Year” at the Construction Week India Awards 2015, ‘Golden Peacock Award for Sustainability for the year 2015 by the Institute Of Directors (IOD), “Most Reliable Builder for 2014” at the CNBC AWAAZ Real Estate Awards 2014, “Innovation Leader in Real Estate” award at the NDTV Property Awards 2014 and “Popular Choice – Developer of the Year” award by ET NOW in 2013.</p>','2024-01-10 16:59:24.125000','2024-01-10 16:59:27.753000','2024-01-10 16:59:27.749000',2,2,'godrej-properties'),(23,'Mahindra Lifespaces','<p><a style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(68, 68, 68);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:0px;orphans:2;text-align:start;text-decoration:none;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\" target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.mahindralifespaces.com/\">Mahindra Lifespace Developers Ltd</a><span style=\"background-color:rgb(255,255,255);color:rgb(34,34,34);font-family:DidactGothic-Regular;font-size:16px;\"><span style=\"-webkit-text-stroke-width:0px;display:inline !important;float:none;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;orphans:2;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">., the real estate and infrastructure development business of the $16.5 billion Mahindra Group, is a leader in sustainable urban development, through the creation of residential and integrated large format developments across nine Indian cities – Mumbai, Pune, Nagpur, Gurgaon, Faridabad, Jaipur, Chennai, Hyderabad and Bangalore. The Company’s residential &amp; commercial development footprint includes over 0.8 million sqm. (8.3 million sq.ft.) of completed projects and over 1.0 million sq. m. (11.3 million sq. ft.) of ongoing and forthcoming projects.</span></span></p>','2024-01-10 17:12:18.173000','2024-01-10 17:12:23.311000','2024-01-10 17:12:23.307000',2,2,'mahindra-lifespaces'),(24,'Salarpuria Sattva','<p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Kolkata in the year 1985, witnessed the&nbsp;<a style=\"background-color:transparent;box-sizing:border-box;color:rgb(68, 68, 68);margin-bottom:0px;text-decoration:none;\" target=\"_blank\" rel=\"noopener noreferrer\" href=\"http://sattvagroup.in/\">Salarpuria Group</a>&nbsp;embarking on an unending journey of developing superior real estate projects. The group has earned a reputed stature across all its projects sprawling in the residential, retail and commercial projects.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Salarpuria Sattva is striving towards excellence with due support of its team, which is proficient in architecture, facility management, and finance administration.&nbsp;<a style=\"background-color:transparent;box-sizing:border-box;color:rgb(68, 68, 68);margin-bottom:0px;text-decoration:none;\" target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.sattvagroup.in/real-estate/\">Salarpuria group</a>&nbsp;has successfully developed many residential, retail and commercial zones which have gratified many Indian and global patrons.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">The group has always upheld the values of responsible construction by developing sustainable projects. The feat of responsible constructions has been achieved by due investments in technology up-gradation and management services.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Protecting the ecological balance and conserving energy has been few of the other commendable accomplishments of all the projects developed by the Salarpuria group.</p>','2024-01-10 17:25:04.128000','2024-01-10 17:25:07.048000','2024-01-10 17:25:07.045000',2,2,'salarpuria-sattva'),(25,'Pacifica Builder','<p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\"><a style=\"background-color:transparent;box-sizing:border-box;color:rgb(68, 68, 68);margin-bottom:0px;text-decoration:none;\" target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.pacificacompanies.co.in/\">Pacifica</a> forayed into the Indian real estate industry, commencing operations in 2004-05.Continuing its legacy of unique urban structures across varied asset classes, Pacifica has made quite an impression in the minds of investors across the nation. Focusing primarily on the needs of the burgeoning middle class, the group has leveraged its decades-old experience in real estate to ensure better living experience and optimum space allocation in every project.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Our global team of value creators and real estate domain experts have until now, established a robust reputation in the Indian milieu. Our sense of innovation and aesthetics have also transformed the architectural skyline in the urban hemisphere of Ahmedabad, Vadodara, Deesa, Chennai, Hyderabad, Bangalore, and NCR.</p>','2024-01-11 05:33:52.124000','2024-01-11 05:33:57.794000','2024-01-11 05:33:57.790000',2,2,'pacifica-builder'),(26,'Goyal & co','<p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\"><a style=\"background-color:transparent;box-sizing:border-box;color:rgb(68, 68, 68);margin-bottom:0px;text-decoration:none;\" target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.goyalco.com/\">Goyal &amp; co.</a> was founded by the late Mr. Rampurshottam Goyal in 1970 in the city of Ahmedabad. A bachelor in civil engineering from Jodhpur University, he started the company with limited means. With his heart set on a long term vision and years of perseverance, he grew Goyal &amp; Co into one of the leading real estate development companies in Western India, both in terms of residential and commercial.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">The brand has changed the skyline of Ahmedabad as well as earned the respect of the city with a legacy synonymous with excellence, innovation and transparency. Choicest locations, perfect planning and immaculate implementation have ensured value for money for it’s customers. Known for delivering beyond the call of duty, Goyal &amp; Co has systematically built on its credibility and goodwill with every project it has launched over the years. Each one being a true testament in innovation, design and construction.</p>','2024-01-11 11:23:26.993000','2024-01-11 11:23:30.409000','2024-01-11 11:23:30.406000',2,2,'goyal-and-co'),(27,'Prestige Group','<p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">The Prestige Group owes its origin to Mr. Razack Sattar, who envisioned a success story waiting to take shape in the retail business in 1956 itself.&nbsp;<a style=\"background-color:transparent;box-sizing:border-box;color:rgb(68, 68, 68);margin-bottom:0px;text-decoration:none;\" target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.prestigeconstructions.com/blog/\">Prestige Estates</a>&nbsp;and Properties was set up in 1986 growing swiftly to become the leading property developers in Bangalore.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Prestige Court on K.H. Road in Bangalore set the pace, and with over 190 developments covering 38.5 million sq ft of developable area to its credit, Prestige constructions now house a very large populace residing in South India.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Also, Prestige hosts some of the biggest MNCs in business here with residential, commercial, retail, and hospitality developments on the cards approximating 61.4 million sq. ft. just in the area.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">A presence in the retail sector with Prestige Tech Cloud Park, multiplexes, and malls, Prestige has built for itself a name in property development.</p>','2024-02-06 08:26:40.282000','2024-02-06 08:30:06.445000','2024-02-06 08:26:43.587000',2,2,'prestige-group'),(28,'Provident Housing','<p>Provident Housing Limited ; Established in 2008, Provident Housing Limited is a large-scale community developer, offering the greatest value&nbsp;within the residential segment.&nbsp;The company caters to the diverse residential needs of buyers, with a focus on aspirational home ownership.</p><p>The pioneers in making Premium homes affordable is a 100% subsidiary of Puravankara Projects Limited, one of the real estate majors of India.</p><p>Provident Housing caters to the premium affordable housing segment targeting first time home buyers. We are currently executing three projects at Bangalore and Chennai. The three projects together provide about 6.5 million SFT of living space. The configuration mix is one, two and three bedroom apartments and the basic cost ranges from 17.74 Lakhs to 42.15 Lakhs.</p><p>Provident Housing has launched 9 residential projects, in 4 major Indian cities, touching lives of more than 6500 families. The company has been a recipient of multiple awards over the last few years, including “Best Brand of the Year Award 2015”.</p>','2024-02-06 12:05:29.172000','2024-02-06 12:05:31.900000','2024-02-06 12:05:31.896000',2,2,'provident-housing'),(29,'DNR group','<p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">DNR group is backed by pharmaceutical conglomerate Micro Labs Ltd. (Micro Labs and its associate companies is a multi-faceted organization with an annual turnover of Rs.1500 crore, including exports that contribute Rs. 450 crore. The organization’s most important component,&nbsp; remains its 6000 dedicated employees)</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">The core maxim of any civilization is happiness. Through prosperity of being and becoming, DNR Corp partakes in the millennia old wisdom established by our enlightened ancients.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Fluid, Dynamic, Evolving. A venture that creates, regulates and improvises itself constantly, to keep in step with our ever sprawling cities, <a style=\"background-color:transparent;box-sizing:border-box;color:rgb(68, 68, 68);margin-bottom:0px;text-decoration:none;\" target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://dnrgroup.in/\">DNR Group</a>’s presence has become synonymous with being best in the real estate world.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">The key to our work ethic is Innovation and Interaction. Be it information or individual, we are the gardeners, willing and eager to invest loving efforts and energy into the aspiration of the full bloom. Combining a cohesive and consistent Quality Standard with ever vigilant Customer Service, we accomplish the Life Spaces which are breathtaking in attributes.</p>','2024-02-06 12:48:49.817000','2024-02-06 12:48:54.923000','2024-02-06 12:48:54.920000',2,2,'dnr-group'),(30,'Embassy Group','<p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Embassy Property Developments Private Limited commenced operations in 1993. Together with our promoters, we have 28 years of experience in real estate development. Embassy has an extensive land bank across the country and has developed close to 30 million square feet of prime commercial, residential and retail space as of March 2012. We also have international operations in Malaysia and Serbia.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Over the last 28 years,&nbsp;<a style=\"background-color:transparent;box-sizing:border-box;color:rgb(68, 68, 68);margin-bottom:0px;text-decoration:none;\" target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.embassyindia.com/\">Embassy</a>&nbsp;has completed over 5.3 million sqft. of residential spaces. Embassy’s ongoing residential projects include luxury apartments and integrated townships. Residential projects are also designed to obtain IGBC Green Homes Certifications ratings as part of the efforts for creating sustainable developments.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Company’s vision for the future is to leverage its tenant relationships and expand the portfolio of Information Technology space throughout India and internationally, besides focusing on developing residential and retail spaces. We will be developing hospitality projects in the integrated townships and business parks that we develop.</p>','2024-02-07 08:05:00.097000','2024-02-07 08:05:03.797000','2024-02-07 08:05:03.791000',2,2,'embassy-group'),(31,'Rohan Builders','<p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Rohan Builders (India) Private Limited – a Pune based Builders started in 1993 as a modest but strong, multi-disciplinary Organization, with diverse interests in Infrastructure Development, Industrial Construction.</p><p class=\"Paragraph\" style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">In the real estate space, the Rohan group is known for new concepts in residential development, including innovative design and structure, modern and new amenities, quality construction and timely delivery. Rohan has received ‘DA2 CRISIL rating for Real Estate Development’ signifying its commitment to delivering quality product. It has real estate operations in Pune and Bangalore.</p><p class=\"Paragraph\" style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">The group also has a substantial presence in the infrastructure segment mainly construction of roads and bridges on BOT or Annuity basis. It has executed projects in Punjab, Rajasthan and Maharashtra.</p><p class=\"Paragraph\" style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\"><a style=\"background-color:transparent;box-sizing:border-box;color:rgb(68, 68, 68);margin-bottom:0px;text-decoration:none;\" target=\"_blank\" rel=\"noopener noreferrer\" href=\"http://www.rohanbuilders.com/blog\">Rohan Group</a>&nbsp;also has interests in Agriculture, Renewable Energy, and Information Technology space.</p>','2024-02-07 08:24:22.426000','2024-02-07 08:24:25.634000','2024-02-07 08:24:25.631000',2,2,'rohan-builders'),(32,'Shriram Properties','<p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Shriram Properties is part of the Shriram Group of companies, an INR 90,000 crore financial conglomerate with a strong presence across East India.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\"><a style=\"background-color:transparent;box-sizing:border-box;color:rgb(68, 68, 68);margin-bottom:0px;text-decoration:none;\" target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.shriramproperties.com/about-us/\">Shriram Properties</a>&nbsp;was established in 1995 with its headquarters in Bengaluru and is a leading real estate developer with projects in Bengaluru, Chennai, Kolkata, Coimbatore, and Vizag.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">More than 20,000 sq.ft of built-up space, with an additional 12 million sq.ft. close to completion and 45.85 million sq.ft still under development by Shriram Properties. Their projects include apartments, villas, and villaments.</p>','2024-02-07 08:52:44.634000','2024-02-07 08:52:47.036000','2024-02-07 08:52:47.032000',2,2,'shriram-properties'),(33,'TVS Emerald','<p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">At <a style=\"background-color:transparent;box-sizing:border-box;color:rgb(68, 68, 68);margin-bottom:0px;text-decoration:none;\" target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.tvsemerald.com/about-us/\">TVS Emerald</a> we understand the importance of harmony between man and nature. Our homes provide you with not just enough green cover for your lungs, we also use alternative energy. We recycle and reuse in order to reduce our carbon footprint.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">We build homes that adhere to the best international practices. To us, quality has to be measurable. We are the first developer in Chennai to get our homes certified by , The Construction Quality Assessment System from Building and Construction Authority (BCA), Singapore.</p>','2024-02-07 09:10:10.094000','2024-02-07 09:10:15.022000','2024-02-07 09:10:15.019000',2,2,'tvs-emerald'),(34,'INDIS Builder','<p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">In its journey spanning a decade, from the handover of its first tower in the year 2011 to its maiden and flagship project – PBEL CITY, till now, <a style=\"background-color:transparent;box-sizing:border-box;color:rgb(68, 68, 68);margin-bottom:0px;text-decoration:none;\" target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://indis.co.in/\">INDIS</a> has come a long way. Having successfully launched 3 more major projects in the interim – ONE CITY, VB CITY, and VIVA CITY; INDIS now has about 5,000 customers on board.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">With its continuous efforts in building Engineering capabilities; use of robust technologies, such as the shear wall method of construction; engaging reputed construction partners; collaboration with renowned fund houses; sturdy systems and processes, and its unwavering focus on customer service, INDIS has built its reputation of being progressive; reliable, innovative, and a transparent Real Estate Company.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">With Excellence in Engineering; Constant Innovation and Learning at its core, INDIS is set to cross many more milestones in the coming years.</p>','2024-02-07 09:46:14.371000','2024-02-07 09:46:17.408000','2024-02-07 09:46:17.403000',2,2,'indis-builder'),(35,'Candeur Developers','<p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">As one of the emerging leaders in the development of residential communities,&nbsp;<a style=\"background-color:transparent;box-sizing:border-box;color:rgb(68, 68, 68);margin-bottom:0px;text-decoration:none;\" target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://candeurcrescent.com/\">Candeur Developers</a> has quickly established itself as a premier developer of multi-family and residential projects.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">We cemented our position in Hyderabad more than 2 years ago with a High Rise Project of 40 floors and we have 2 more projects upcoming in the pipeline. The team is very upbeat about our Hyderabad projects and is overwhelmed by the response we have got so far &amp; will continue to keep striving for excellence and quality in whatever we deliver.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">We are one of the leading Real Estate Developers in Bengaluru, having delivered 4 lifestyle projects. We have always ensured that we live up to our commitments and have delivered our projects on time. This explains why the majority of our upcoming projects are being sold majorly through our existing client references.</p>','2024-02-07 12:44:36.291000','2024-02-07 12:44:38.389000','2024-02-07 12:44:38.386000',2,2,'candeur-developers'),(36,'DRA Homes','<p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">DRA Management has collective industry experience of over 100 years and rich expertise across various functions of real estate development. All of which come together to spell NICE to our customers, employees, vendors, and other stakeholders. From being the harbingers of apartment complex concept in Bangalore to developers of South India’s first-ever township, DRA has proven its expertise and made an indelible mark across the cities of Bangalore, Chennai, Goa, and Mysore</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\"><a style=\"background-color:transparent;box-sizing:border-box;color:rgb(68, 68, 68);margin-bottom:0px;text-decoration:none;\" target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.drahomes.in/\">DRA</a> delivers Quality &amp; Value leading to the invaluable trust of our clients by maintaining transparency in all our transactions, Applying appropriate and efficient technologies, Monitoring &amp; evaluating processes &amp; procedures continuously, Ensuring timely completion of projects.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">This will be achieved through continual improvement and dedication by our trained team of people.</p>','2024-02-08 08:32:22.748000','2024-02-08 08:32:25.338000','2024-02-08 08:32:25.335000',2,2,'dra-homes'),(37,'Puravankara Builder','<p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Since its inception in 1975,&nbsp;<a style=\"background-color:transparent;box-sizing:border-box;color:rgb(68, 68, 68);margin-bottom:0px;text-decoration:none;\" target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.puravankara.com/\">Puravankara</a>&nbsp;has believed that there is only one mantra for success: Quality. This credo combined with uncompromising values, customer-centricity, robust engineering, and transparency in business operations, has placed it among the ‘most preferred’ real estate brands in both residential and commercial segments.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">The Company has grown from strength to strength, having successfully completed 36 residential/commercial projects spanning 7.80 million square feet. Currently, it has 29 million square feet of projects under development, with an additional 88 million square feet in projected development over the next 7-10 years. An ISO 9001 certification by DNV in 1998 and a DA2+ rating by CRISIL are a testament to Puravankara’s reputation as a real estate developer of the highest quality and reliability standards.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">The Group commenced operations in Mumbai and has established significant presence in the metropolitan cities of Bangalore, Kochi, Chennai, Coimbatore, Hyderabad, Mysore and overseas in Dubai, Colombo and Saudi-Arabia.</p>','2024-02-08 08:43:18.647000','2024-02-08 08:43:22.205000','2024-02-08 08:43:22.201000',2,2,'puravankara-builder'),(38,'Sumadhura Group','<p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\"><a style=\"background-color:transparent;box-sizing:border-box;color:rgb(68, 68, 68);margin-bottom:0px;text-decoration:none;\" target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://sumadhuragroup.com/\">Sumadhura Infracon Pvt. Ltd.</a> is one of the prominent residential and commercial real estate developers in Bangalore &amp; Hyderabad. One of the most admired and trusted brands, Sumadhura has been growing from strength to strength over the past two decades marking its presence over the skylines of Bengaluru and Hyderabad. Sumadhura so far has delivered over 8 million sft of projects while approximately 16 million sft of projects are under construction and planning stages. From being prominently a residential developer, Sumadhura has expanded its horizons into Commercial, Coliving, Plotted Development and other real estate verticals.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Over the past two decades Sumadhura has delivered more than 45 projects where thousands of happy customers reside. Our projects are built to provide exceptional life experiences, security and value. Sumadhura properties have seen the highest rate of capital appreciation and have given our customers an asset to own for life.</p>','2024-02-08 09:14:05.797000','2024-02-08 09:14:08.239000','2024-02-08 09:14:08.235000',2,2,'sumadhura-group'),(39,'Total Environment','<p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">At&nbsp;<a style=\"background-color:transparent;box-sizing:border-box;color:rgb(68, 68, 68);margin-bottom:0px;text-decoration:none;\" target=\"_blank\" rel=\"noopener noreferrer\" href=\"http://www.totalenvironment.in/\">Total Environment</a>, we are focused on creating spaces that you can be proud of living and working in. Our goal is to combine our professional expertise with cutting-edge technology and an out-of-the-box approach to make living more comfortable, productive and joyous.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">We work together as an integrated team – from concept to completion. This high degree of interaction between our design, construction and business development teams ensures that every little detail gets the close attention it deserves.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">We combine our design skills with excellent craftsmanship to deliver homes of the highest quality, always striving to design and build the most beautiful homes in the world.</p>','2024-02-08 09:23:16.354000','2024-02-08 09:23:19.977000','2024-02-08 09:23:19.971000',2,2,'total-environment'),(40,'SOBHA Limited','<p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Founded in the year 1995,&nbsp;<a style=\"background-color:transparent;box-sizing:border-box;color:rgb(68, 68, 68);margin-bottom:0px;text-decoration:none;\" target=\"_blank\" rel=\"noopener noreferrer\" href=\"http://sobha.com/\">Sobha Limited</a>&nbsp;is one of the largest real estate development company in India. It’s a Rs. 22 billion company based out of Bangalore and having projects spread across 13 states and 24 cities.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Sobha Limited is primarily focused on the development of residential and contractual projects. The residential projects range from villas and row houses to plotted development, presidential apartments, luxury, and super luxury apartments. Every Sobha project comes equipped with every major amenity including shopping complex, clubhouse, and swimming pool.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Presently, almost 35 residential projects are under construction aggregating to 27.32 million sq. ft. of space under development. 18.90 million sq. ft. of saleable space in addition to ongoing contractual projects adding up to almost 9.50 million square feet of area.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:border-box;color:rgb(34, 34, 34);font-family:DidactGothic-Regular;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin-bottom:26px;margin-top:0px;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Sobha&nbsp;has constructed a wide array of structures for prestigious corporate clients most noteworthy being Dell, Institute of Public Enterprises (IPE), Taj Group, Hotel Leela Ventures, Infosys, Bosch, HP, Biocon, Timken and more.</p>','2024-02-09 09:54:15.063000','2024-02-09 09:54:17.715000','2024-02-09 09:54:17.711000',2,2,'sobha-limited'),(41,'Raghava Builder','<p>A professionally managed organisation that commenced as a conglomerate in 1991, Raghava is committed to excellence, quality, and client satisfaction. Our businesses span the sectors of engineering &amp; construction, real estate, infrastructure, and urban development &amp; management. We strive for innovativeness by empowering our teams to create value and attain the highest standards. We endeavour to provide reliable and integrated quality services in order to contribute to the infrastructural growth in India. Recently, we emerged as a real estate company developing and building responsible infrastructure through our practices.</p><p>Raghava is not just a real estate company but also a company that changes people’s lives with world-class homes, superior amenities and above all a magnificent living experience. For us, homes are what make people, families and communities. A home is where great relationships kindle and real happiness lies.</p><p>Our vision, at Raghava, is to make fine living an experience by providing the choicest amenities, highly curated facilities and delivering landmark constructions driven by engineering excellence.</p><p>Our mission is to bring the best of this world to our every project, offer exceptional service, forge lasting relationships with our patrons and stand as a premier real estate company.</p>','2024-02-09 10:38:38.103000','2024-02-09 10:38:43.363000','2024-02-09 10:38:43.360000',2,2,'raghava-builder'),(42,'Keya Homes','<p>Since its inception in 2013, Keya Homes has been transforming lifestyles. The philosophy has always been to create homes that take the man to the future by bringing nature and technology to man. A philosophy that’s been brought to life with green projects, solar power, and futuristic technology. This promise of sustainable living has been aptly complemented by smart designs and signature lifestyle choices.</p><p>By nestling your every step with lush greenery and fresh air, we’ve restored the purity of nature. And by introducing your distinct tastes to contemporary amenities, we’ve created the future for you. But we haven’t stopped there we’ve lent thoughtfulness to our creativity with a transparent, hands-on approach that combines the best of planning and execution to deliver uninhibited happiness.</p>','2024-02-12 11:13:09.726000','2024-02-12 11:13:12.247000','2024-02-12 11:13:12.245000',2,2,'keya-homes'),(43,'Lodha Group','<p>Whether it’s crafting the world’s most luxurious residences or giving India its most iconic address; adding a glittering icon to Mumbai’s skyline or creating designer residences for Mumbai’s glitterati; delivering meticulously designed offices or conceiving India’s No.1 smart city with the highest liveability quotient – Lodha has been transforming the way we live with the world’s finest developments.</p><p>Among the top builders in India, we deliver the world’s finest developments across geographies, markets, price points, and consumer segments. We have the experience and skills to deliver both quality and scale, at a pace that is unmatched in the country. By forging the finest global partnerships, deploying the best people and processes, delivering to the customer’s highest expectations, and benchmarking to the global best, Lodha has been consistently delivering the world’s finest developments – across residential, retail, and office spaces, winning the trust and appreciation of our patrons, time and again.</p><p>Most importantly, as an organization that makes probably the longest-term impact: on our environment, urban fabric, and the lives of those who live and work in our developments, we are committed to acting in the larger interest of the environment and society. Sustainability is at the core of our operations and we aim to become the global leader in sustainable real estate development.</p>','2024-02-13 06:29:13.804000','2024-02-13 06:29:23.286000','2024-02-13 06:29:23.276000',2,2,'lodha-group'),(44,'K Raheja Corp','<p>K Raheja Corp. is a success story spanning four decades and stands today as one of India’s leading developers.</p><p>From exquisite residences to adaptive workplaces like Mindspace, skillfully created hotels like Chalet and convention centers to outstanding retail destinations like Inorbit Mall, the K Raheja Corp. has made a significant impact on the evolution of modern-day living.</p><p>K Raheja Corp. delivers aspirational spaces with distinct characteristics and attributes, making each of its offerings unique. The Company has also been ahead of the curve in the green development sector. Pioneering the industries’ responsibility towards contributing to a green society, it signed a memorandum of understanding with the CII-Green Building Council to construct green buildings, back in 2007. Apart from its eco-friendly constructions, K Raheja Corp. is committed to developing large, green expanses across the country. With its buildings certified in the categories of Gold and Platinum, it has been recognized with awards across prestigious forums.</p><p>Backed by the belief that ‘people are a company’s greatest asset and competitive advantage’, K Raheja Corp. leads the way with exemplary HR policies, judiciously collated from the best across industries, to ensure employee engagement and fulfillment.</p>','2024-02-13 06:48:35.797000','2024-02-13 06:48:38.378000','2024-02-13 06:48:38.372000',2,2,'k-raheja-corp'),(45,'Abhee Ventures','<p>We are a group of young, vivacious, privately held entrepreneurs who are devoted, real estate enthusiasts. ABHEE Ventures is led by R NAGARAJ REDDY and has its headquarters in Bangalore.</p><p>For us, the phrase “TURNING LAND INTO LANDMARKS” is more than just a catchphrase; it embodies our attitude of turning land into vibrant, living landmarks. From having a vision to incorporating the vision into the design philosophy and bringing the design philosophy to life by balancing various aspects like blending the natural landscape features with the functional requirements to highlighting particular features to using subtlety with precision and perfection, creating landmarks involves many parameters.</p><p>As India races fast into the future, we are evolving to cater to its demands and create real estate solutions. With cities swarming with IT parks, MNCs, MSMEs, and startups, to name a few, we create hubs of comfort, connectivity, and convenience more prescient than the rest.</p>','2024-02-13 08:21:18.250000','2024-02-13 08:21:20.881000','2024-02-13 08:21:20.874000',2,2,'abhee-ventures'),(46,'Adroit Urban Developers','<p>Widely regarded as one of the most experienced and reputed names in the industry, Adroit Urban Developers Developers was founded in the year 2006 and is an award-winning real estate developer in Chennai. A saga of over 1000 homes built and over 1 million sq. ft. developed across Chennai and Coimbatore.</p><p>We are committed to creating spaces to be cherished over a lifetime. A confluence of experience and expertise in developing landmark homes and an insatiable need to address every need of a home-owner makes us a name you can trust to deliver consistently the nucleus of any happy family – a home.</p><p>“Ahead thinking” is the philosophy that drives our pioneering spirit. It is a mantra that makes us a leading real estate developer in Chennai, a force that propels our ability to innovate and transform spaces and places. Our homes are not just designed to delight you at first sight; they’re timeless masterpieces. We believe in building lifelong investments that are future-forward and people-centric.</p>','2024-02-13 09:56:53.757000','2024-02-13 09:56:55.987000','2024-02-13 09:56:55.983000',2,2,'adroit-urban-developers'),(47,'Mahendra Arto LLP','<p>MAHENDRA ARTO LIMITED LIABILITY PARTNERSHIP is a limited liability partnership business entity registered under The LLP Act, 2008. Its incorporate as LLP limited company dated 2022-01-05. It’s registered for pre-defined objects or activity Construction as per Activity Code mentioned under Company CIN Number ABA-1309. Company has total contribution of Rs. 500000.00, Number of Designated Partners – number_of_designated_partners and Partners 2. It is set up directly by registering the company with RoC, Ministry of Corporate Affairs. Its registered office address is Plot 51 KB Royal RS Gardens Layout Bommasandra Bangalore IN 560099.</p><p>Status of Company is ACTIVE. MAHENDRA ARTO LIMITED LIABILITY PARTNERSHIP registered state is Karnataka, India.</p>','2024-02-13 15:52:57.494000','2024-02-13 15:52:59.882000','2024-02-13 15:52:59.879000',2,2,'mahendra-arto-llp'),(48,'Trendsquares Constructions','<p>Trendsquares Constructions is a forward-thinking, upward-moving property development company who specializes in delivering quality living spaces to discerning home seekers.</p><p>Art and science, architecture and space planning, features and amenities come together in each of our projects. Our customers are assured of the finest buying experience and after-sales service, since their needs come first for us. We ensure that a home is a complete package of experiential living.</p><p>The designs we conceive, the locations we choose and the materials we use are totally environment-friendly. Being sensitive to nature and to the customer\'s dreams, we at Trendsquares Constructions are in the business of building happiness, pure and simple.</p><p>We believe in thinking differently and creating enhanced experiences for our home owners. Our vision is to create benchmark projects that offer the highest standards of quality. Maintaining timelines and meeting stringent parameters is our way forward.</p>','2024-02-14 07:35:48.740000','2024-02-14 07:35:51.334000','2024-02-14 07:35:51.328000',2,2,'trendsquares-constructions'),(49,'Vertex Homes','<p>Since its inception in 1994, Vertex has been prominently transforming the lives of thousands of happy families across the city by creating futuristic real estate projects. Headquartered in Hyderabad, Vertex has grown to be a leading real estate development company in Telangana and Andhra Pradesh.</p><p>Vertex Homes is a significant name in Hyderabad’s real estate industry. The wide range of projects lined up at Vertex Homes has an option to meet all your demands in the real estate industry.</p><p>Over the years, Hyderabad has become a leading real estate investment destination. It offers better job opportunities and is a steadily growing real estate investment destination. The real estate companies in Hyderabad have a great contribution to this rapid development for the city.</p><p>You will run into a multitude of luxury apartment advertisements from various builders while searching for a new home. This is when you should be wondering about choosing the perfect builder. If you start looking you will find numerous real estate builders in your search and not easy to zero down on one.</p><p>At Vertex Homes, each one of our projects is a success story. Be it luxury apartments or premium open plots. For example, the Vertex Panache.</p><p>Choosing the right builder for your dream home is very important. Your builder is responsible for not only your home but everything it has to offer. At present, there are too many builders in the market. You have to be very cautious should do thorough market research before choosing the best builder who can provide the quality you are looking for, in terms of materials used, architecture and services.</p><p>As your life’s savings are going into a real estate purchase, you must compare analyses and choose the best builder who stands out among its competitors and offers you what suits your needs.</p><p>For both buyers and investors, Vertex Homes offers an array of property options – both budget and luxury. Every residential luxury apartments by Vertex Homes hosts numerous premium amenities which include a loaded clubhouse, well-equipped gymnasium, swimming pool, kids play area, cafeteria, 24*7 security system, multipurpose rooms and many more well within its premium gated communities. It is the uncompromised quality trust that makes Vertex Homes one of the best real estate company in Hyderabad.</p>','2024-02-14 08:04:19.173000','2024-02-14 08:04:21.807000','2024-02-14 08:04:21.805000',2,2,'vertex-homes'),(50,'Sameera Estates','<p>Sameera Estates Private Limited is a real estate company, which aims at creating “High Quality Township Projects” across Tamil Nadu, using the latest technology in constructions.</p><p>The Company started its foray into the real estate business with the launch of its first plotted development in the early 2000\'s. In the last 17 years, the company has sold real estate properties across Chennai, Kanchipuram, Vellore and Arcot districts.</p><p>Having created a name for themselves in the Land Trading, Education, Transportation &amp; Hospitality industries, the group now aims at venturing into the real estate residential business with their maiden project “SAMEERA 117“, an Integrated township in Poonamallee, Chennai.</p><p>Vision &amp; Mission : To offer “Excellent customer support, High quality construction, Organized workmanship and Timely delivery” of projects.</p><p>Sameera Estates Private Limited is a real estate and land Trading company, which aims at creating “High Quality Township Projects” across Tamil Nadu, using the latest technology in the constructions.</p>','2024-02-14 08:24:02.844000','2024-02-14 08:24:06.696000','2024-02-14 08:24:06.693000',2,2,'sameera-estates'),(51,'LIFESTYLE HOUSING','<p>Stepped up in 2010, Lifestyle housing scouted on some fine<br>neighborhoods in Chennai and has developed homes and<br>communities here ever since.</p><p>With over 8 projects completed and 4 underway, Lifestyle holds<br>sufficient equity in credibility and is on a rapid growth curve.<br>Contemporary, functional, considerate living, i.e. the Lifestyle at Lifestyle Housing.</p><p>We, at Lifestyle Housing, move ahead as the trailblazers of getting along with real estate business in the society of responsible customers with a broader vision and profound mission.</p><p>Our approach with organization orientation gets along with employment generation and granting livelihood for many of the eligible individuals. We, at Lifestyle Housing, with an idea to transform barren lands into beautiful colonial paradises, open doors for plethora of skilled individuals from land procurers to surveyors, labourer to engineers, architects to marketing personnel and many more.</p><p>&nbsp;</p><p>We, Lifestyle Housing, believe in perpetuating relationship with customers by means of focused, dedicated and responsible approach in service and blending with indelible emotional bond. We never measure our success in procuring monitory gains but gauge the same in securing loyalty, faith and goodwill from the customers.</p>','2024-02-14 13:35:28.781000','2024-02-14 13:35:31.495000','2024-02-14 13:35:31.491000',2,2,'lifestyle-housing'),(52,'Adityaram Group','<p>Adityaram Group is a leading company in South India that has two decades of track record of customer satisfaction with the completion of privileged projects. Adityaram group is The real estate giant has managed to spread its wings over the three South Indian states Tamilnadu, Telangana and Andhra Pradesh. The Group was founded by its Chairman and Managing Director, Mr. Adityaram, a Self-made billionaire businessman. Tamilnadu, Telangana, and Andhra Pradesh are the three South Indian states where our company has expanded its wings. Adityaram Group functions in the real estate sector through its company named Adityaram Properties Private Limited.</p><p>With its landmark offerings, the company has managed to carve a space for itself in the competitive Chennai real estate market. The progress and development of Adityaram Group have been remarkable directly under Mr. Adityaram’s Leadership. The business of success includes Adityaram Properties (P) Ltd, Adityaram Studios (P) Ltd, Adityaram Movies, Adityaram Housing (P) Ltd, Adityaram Infrastructure Projects LLP, and Adityaram Convention and Resorts.</p>','2024-02-14 15:14:37.792000','2024-02-14 15:14:40.550000','2024-02-14 15:14:40.545000',2,2,'adityaram-group'),(53,'BSCPL INFRASTRUCTURE','<p>BSCPL Infrastructure Ltd is an ISO 9001:2015 certified infrastructure development company pioneers in execution of Road Projects, Irrigation projects and recently diversified into Real estate and Hydro Power plants. BSCPL have executed several prestigious projects across India and abroad including Afghanistan &amp; Bangladesh, sometimes under adverse conditions. The experienced and visionary team of promoters, high degree of mechanization with skills in the state of the art technology, professionally qualified and experienced project managers and strong and stable workforce who can execute projects under adverse conditions, the ability to forge partnerships wisely and the practice of executing projects on their own has enabled BSCPL to emerge as a strong partner in the process of building the lifelines of nations. The awarding of grade CR2+ by ICRA indicating strong capacity to execute projects up to Rs. 350 crores in a year.</p><p>BSCPL is a Hyderabad based conglomerate, which has business interest in various types of infrastructure areas like roads, airports works, bridges, building construction, real estate projects, irrigation projects and railway freight corridor works.</p>','2024-02-14 15:50:02.674000','2024-02-14 15:50:05.455000','2024-02-14 15:50:05.451000',2,2,'bscpl-infrastructure'),(54,'Pragnya Construction','<p>Pragnya Builders is a real estate development company. It is committed to providing spectacular projects that deliver the best value for customer’s money. The developer aims to transform the property dreams of the customers into reality. It ensures that its projects emanate meticulous planning, quality material, and excellent workmanship. The company strives to be a front runner in the realm of real estate development by providing feature-rich projects that offer comfortable living</p>','2024-02-15 13:46:50.396000','2024-02-15 13:46:53.211000','2024-02-15 13:46:53.208000',2,2,'pragnya-construction'),(55,'NCC URBAN','<p>NCC Urban Infrastructure Limited is a subsidiary of NCC Limited and comes equipped with a world class building techniques and state-of-the-art building infrastructure that is expertly commandeered by top-notch professionals.</p><p>NCC Urban’s quality operations span across residential and commercial complexes, townships, SEZs and serviced apartment complexes. The company has an impressive pan India presence across Bangalore, Hyderabad, Kochi, Vizag, Guntur, Ranchi and Dubai. Strict adherence to superior standards, on time deliveries and transparent documentation has made NCC Urban the preferred choice for individuals who are looking for quality living at justified prices.</p><p>Rapid urbanisation of the country has given rise to large scale migration to tier II towns and cities creating a greater demand for buildings for different purposes.</p>','2024-02-15 14:54:04.144000','2024-02-15 14:54:06.552000','2024-02-15 14:54:06.548000',2,2,'ncc-urban'),(56,'Purva Land','<p>Purva Land is a subsidiary of one of India’s largest real estate developers, The Puravankara group. With 45+ years of experience, Purva Land is armed with the knowledge to find and develop plotted communities that have immense economic potential for growth.</p><p>PurvaLand is a venture that aims to provide plotted communities for you to invest in across the country. It focuses on finding and developing communities that will be situated on the outskirts of thriving metro cities across the country.</p><p>While we carefully choose sites that make access to the city easy and quick, our goal is to give you an opportunity to invest in land that will give you time for yourself and your family, where you can decide the pace of life. We want to give you a place where you can decide how your dream home takes shape.</p><p>Puravankara has grown from strength to strength, having successfully completed 36 residential/commercial projects spanning 7.80 million square feet. Currently, it has 29 million square feet of projects under development, with an additional 88 million square feet in projected development over the next 7-10 years. An ISO 9001 certification by DNV in 1998 and a DA2+ rating by CRISIL are testaments to Puravankara’s reputation as a real estate developer of the highest quality and reliability standards.</p>','2024-02-16 03:58:55.183000','2024-02-16 03:58:57.813000','2024-02-16 03:58:57.809000',2,2,'purva-land'),(57,'Address Makers','<p>Piramal Fund Management is a leading Real Estate Private Equity &amp; Debt platform promoted by Piramal Enterprises, a multi-billion dollar business conglomerate with diverse interests such as pharmaceuticals, specialty glass, real estate and financial services with operations in over 100 countries across three continents.</p><p>Piramal Fund Management encompasses an overall corpus of over INR 7500 crores across 7 Funds and 3 third party mandates. The fund has investments across various real estate projects in Mumbai, NCR, Bengaluru, Pune, Hyderabad and Chennai.</p><p>THE ADDRESS MAKERS has carved out a vision that it foresees to achieve in residential offerings. The expertise and practical understanding of real estate industry offers an inherent assurance of successful implementation &amp; timely delivery of real estate projects.</p>','2024-02-16 07:44:20.552000','2024-02-16 07:44:24.520000','2024-02-16 07:44:24.517000',2,2,'address-makers'),(58,'Shapoorji Pallonji','<p>Shapoorji Pallonji Real Estate is a part of the Shapoorji Pallonji Group – a large conglomerate with multiple business segments and having a rich legacy of over 145 years which is well known in India as well as overseas. Shapoorji Pallonji Real Estate is a prominent force in the Indian real estate sector.</p><p>The company is credited of structuring numerous brilliant architectural marvels on a pan India basis in various verticals like – IT Parks, Residential, Commercial, Retail, Redevelopment etc. Shapoorji Pallonji Real Estate is a turnkey solution provider with professional teams like business development, operations, marketing and finance, legal and associated functional teams at its disposal. Shapoorji Pallonji Real Estate has vast experience in the corporate realty segment and the chain of SP Info city of IT Parks in the IT/ITES SEZs at multiple locations across the country are a testimony to this capability. The SP Info city IT Parks are world-class developments featuring usability, facilities and amenities.</p>','2024-02-16 08:57:33.029000','2024-02-16 08:57:36.830000','2024-02-16 08:57:36.827000',2,2,'shapoorji-pallonji'),(59,'SNN Raj Corp','<p>Established in 1994, SNN Estates have completed over 40 projects covering more than 12 million sqft. SNN Estates property development portfolio is diverse in scope and style, attracting considerable interest from not just end consumers but also from many investors. The key competitive advantages are SNN’s sound financial backing, availability of large resources and high level of management expertise.</p><p>SNN’s corporate philosophy is to focus on balancing the evolving needs of a modern city while maintaining and conserving the environment. Most of our ongoing &amp; upcoming projects are located in South &amp; North Bangalore with a range of 1,2,3,4 BHK.</p>','2024-02-16 10:23:04.802000','2024-02-16 10:23:07.382000','2024-02-16 10:23:07.378000',2,2,'snn-raj-corp'),(60,'Mahendra Homes Pvt Ltd','<p>Mahendra Homes is an infrastructure company headquartered in Bangalore and has been incorporated as Private Limited Company under the dynamic leadership of Sri B.T. Nagaraj Reddy. The promoter comes with vast exposure and experience in the field of Construction, Construction products and Real estate.</p><p>Since our inception, Mahendra homes core objective has been to focus on the growth trajectory of Bangalore, delivering residential abodes that are at par with international standards. All our projects revolve around three key concepts – Design, Construction and Livability.</p><p>Our Current residential projects stands as a testimony of our ethos. Having been delivered with utmost attention to detail, perfect execution and on-time delivery. We are diversifying ourselves beyond residential spaces with malls, commercial &amp; retail Projects.</p><p>Our aim is to be the leading name across Bangalore\'s real estate industry and pioneer the industry with landmark projects with world-class design, quality and on-time delivery.</p>','2024-02-16 13:20:47.650000','2024-02-16 13:20:55.123000','2024-02-16 13:20:55.120000',2,2,'mahendra-homes-pvt-ltd'),(61,'Grand Magnum housing','<p>We are Homeland, a division of Grand Magnum Housing Pvt Ltd. With a flurry of exciting projects in the offering, Homeland plans to pioneer a new revolution in commercial and residential plotted development.</p><p>This is Homeland. This is your land. This is your home. Because home is not a place. It’s an address. It’s where you have arrived. It’s what you’ve achieved. It’s who you are. And because home is not a place. It’s a feeling. Of togetherness. Of neighborhood. Of like-mindedness.</p><p>Home is the land you belong to. Of course, home is where you set off to work from. But also, home is where you return to. Home is what defines you. Your family. And your friends.</p><p>Home is what defines your interests. Your passions. Your aspirations.</p><p>Because home is how you become you. Everybody needs a home.</p>','2024-02-17 07:13:47.177000','2024-02-17 07:13:50.413000','2024-02-17 07:13:50.409000',2,2,'grand-magnum-housing'),(62,'Sidharth Housing','<p>We are an award-winning pioneer in the Real Estate industry having developed and delivered homes to more than 3500+ families since 1999. With thousands of distinctive homes to our credit, we’ve painstakingly refined our processes, allowing our company to create strikingly beautiful and meticulously crafted homes for our clients, within budget and on schedule.</p><p>The combined experience and tenacity of our team has consistently produced the highest caliber housing communities — with more than 22 in developed assets since inception. By staying focused on our strategic and effective site selection process, we leverage data and analytical insights to zero in on prime locations. Most often situated in high growth markets with strong demographics and the highest probability of long-term returns, our housing solutions offer sustainable growth bolstered by our impeccable construction quality.</p><p>At Sidharth Housing we build homes that are architecturally distinctive with diversified amenities, allowing for residents to be immersed in a world of aesthetic living. A reflection of evolving urban needs, our projects are designed to make city living more enjoyable. Blending our industry-leading innovation, data-driven insights, and a legacy of expertise and integrity, we strive to be the team you want to partner with — that’s our promise.</p><p>If you aspire for a lifestyle that towers above the rest, we invite you to step inside.</p>','2024-02-17 08:25:05.452000','2024-02-17 08:25:08.940000','2024-02-17 08:25:08.934000',2,2,'sidharth-housing'),(63,'House of Hiranandani','<p>For the last three decades, the Hiranandani\'s have been single-handedly altering the ethos and aesthetics of real estate in India. The group has built multi-use developments in India on a large scale and have introduced retail, hospitality, healthcare, education and entertainment into their developments. With a unique approach to engineering, planning, and design, the Hiranandanis invest heavily in research and development to ensure they remain at the forefront of value engineering and design.</p><p>Through the environmentally friendly concepts of New Urbanism, their focus has been on converting suburban sprawls into well-planned urban communities such as the Powai and Thane townships which have won several awards for outstanding urban development. These self-sufficient, integrated communities have become aspirational addresses for Umbalites. The group has established various schools, colleges, institutions, and hospitals through trusts. Their clubhouses and community spaces have earned international repute and success.</p><p>All these experiences and expertise are encompassed under the House of Hiranandani, a conglomerate that is set to create new benchmarks for the real estate industry by continuing to break new ground and incorporate path-breaking technology into their design, to create future-ready and intelligent spaces. The House of Hiranandani brings to its customers and stakeholders the benefit of years of experience under one roof, thereby creating a platform from which it will continue its pioneering innovations and set the standard for real estate development in India.</p>','2024-02-17 09:49:51.175000','2024-02-17 09:49:53.597000','2024-02-17 09:49:53.592000',2,2,'house-of-hiranandani'),(64,'Mana Projects','<p>With over a decade of successful ventures in the hospitality industry, D. Kishore Reddy, the Founder, and CMD of Mana Projects Private Limited launched the unique Mana Projects at the advent of this millennium. His prime objective was to develop high-quality housing with a focus on the millennial’s idea of ready-to-move apartments in Bengaluru. His focus has remained on the ever-increasing needs and changing preferences of locals as well as the lifestyle choices of new settlers in the IT capital of India.</p><p>At Mana Projects, our well-organized market presence, strong and diverse portfolio, streamlined manufacturing capabilities and cost-effectiveness give us the edge to not just compete but rise above the competition.</p><p>Since 2000, we have evolved as a reputed construction company in Bengaluru, with business verticals spanning property development, construction, and infrastructure projects. Our attention to detail, vision, and innovation have ensured that we can deliver quality that sets us apart from the rest.</p>','2024-04-11 08:11:51.411000','2024-04-11 08:12:36.704000','2024-04-11 08:12:36.701000',2,2,'mana-projects'),(65,'Kumari Builders','<p>Founded in the year of 2012, the vision and ethos that drives Kumari Builders is to consistently deliver on our promise. We promise to provide a living experience that transcends the ordinary. We promise to design homes that address the challenges faced in the current day. Our promise is to create spaces that remind you of your roots. We built happy homes for over 500 families and have earned the respect of customers and peers alike.</p><p>We make homes that address the problems of new age life where people can live, work, and play. At KBD, we design and build elegant, inspiring, and environmentally sensitive spaces for a higher quality of life. We try to make our projects environment-friendly, through rainwater harvesting, solar heating, and lighting, waste management, and other similar eco-friendly features. KBD is one of the fastest-growing real estate firms in Bangalore.</p><p>&nbsp;</p>','2024-04-11 08:19:00.428000','2024-04-11 08:19:02.642000','2024-04-11 08:19:02.638000',2,2,'kumari-builders'),(66,'Vajram Group','<p>Established in 2009, Vajram Group is the new generation Bengaluru-based Real Estate Company. We have a committed passion for creating functional, user-centric, environmentally sustainable spaces using materials of the highest quality and engineering excellence.</p><p>Our roots are firmly established in the construction industry. We have been delivering quality residential and commercial projects built on the core values that are embedded in us, from the blueprint to brick.</p><p>Since our inception, we have been developing residential and commercial projects in various strategic locations across Bengaluru. We have delivered around 3 million Sq. ft and are poised to deliver another 5 million sq. ft by 2025. We are highly committed to justifying customers’ investment and not compromising on product design, quality, and delivery, affirming transparency in all spheres of business. As we look into the future, we remain staunchly committed to creating better living spaces where people can work, live, and enjoy.</p>','2024-04-11 08:25:48.263000','2024-04-11 08:25:50.514000','2024-04-11 08:25:50.510000',2,2,'vajram-group'),(67,'Kolte Patil Developers Ltd','<p>Kolte Patil Developers Ltd. (KPDL) has been on the forefront of developments with its trademark philosophy of ‘Creation and not Construction’. With over 8 million square feet of landmark developments across Pune and Bengaluru, KPDL has created a remarkable difference by pioneering new lifestyle concepts, leveraging cutting edge technology and creating insightful designs. This iconic journey of success has been inspired by its dynamic leadership, passionate team of experts, league of stakeholders and its ever growing quest for excellence.</p><p>KPDL’s extensive spectrum of creations spans across multiple segments like residential projects, business and retail properties, IT Parks, Integrated Townships and Hospitality Infrastructure. Its core business operations feature varied aspects of construction business, such as location identification, acquisition, project planning, designing and development.</p><p>Over the period of around two decades, we have been acknowledged for quality, commitments, integrity, timely execution, innovative technology up gradations and greater value propositions. With every creation, KPDL has always been endeavoured to stand by these attributes which define its brand promise</p>','2024-04-11 08:52:54.108000','2024-04-11 08:52:59.991000','2024-04-11 08:52:59.987000',2,2,'kolte-patil-developers-ltd'),(68,'CasaGrand','<p>CasaGrand Private Limited is a Chennai-based real estate enterprise started in 2004 driven by a strong belief in building aspirations and fulfilling them. This is manifest in the 20+ million Sq.ft that it has developed and sold till date. Indeed, 17000+ customers fulfilled aspirations across more than 100 projects is a paradigm in itself.</p><p>CasaGrand defines designs and develops quality livings spaces and operates in niche residential segments like luxury villas and Villas in Chennai, Bangalore, and Coimbatore. The company also sells plotted development spaces. Projects in the pipeline are to the tune of around 6500+ crores in the luxury Villas and villas category across these 3 geographies.</p><p>CasaGrand, an ISO certified company, is run by a young management team. It is on an aggressive growth path with expansions plans across South India.</p><p>&nbsp;</p>','2024-04-11 09:03:30.927000','2024-04-11 09:03:33.900000','2024-04-11 09:03:33.897000',2,2,'casa-grand'),(69,'Arvind SmartSpaces','<p>Arvind Infrastructure Ltd. is basically a Lalbhai group company based in Ahmedabad, is a fast-rising name in developing a modern lifestyle and quality homes. They are already on a formidable drive to alter the landscape of the real estate industry with approx. 9 million sq. feet of area is under development across the country.</p><p>Built on eighty years old inheritance of the Lalbhai group and established in the year 2009, Arvind Infrastructure has set its eye on innovative offerings and mega projects in Bangalore &amp; Ahmedabad catering to the residential and industrial house with a common vision – Enriching lifestyles. Arvind Infrastructure is committed to excellence, innovation, perseverance and the undying attention to customer needs.</p><p>&nbsp;</p>','2024-04-11 17:29:52.271000','2024-04-11 17:29:54.501000','2024-04-11 17:29:54.497000',2,2,'arvind-smart-spaces'),(70,'Manyata Developers','<p>Manyata is a pioneering real estate development firm that was founded by Reddy Veeranna with a vision to create quality infrastructure across residential, commercial, and mixed-use developments in India.</p><p>With the right people, resources, and thought capital, Manyata explores the many possibilities of a property and its power to impact businesses and society. With over 4 decades of extensive experience, knowledge, and informed perspectives in the real estate and infrastructure industry.</p><p>Manyata has promoted and developed more than 330 acres of Integrated communities, while more than 800 acres are under planning and development. Several Fortune 500 companies have located their businesses at Manyata Tech Park which is Bangalore’s first and largest operational SEZ that prides itself on bringing the live-work-play concept to life in India. Today, Manyata is synonymous with world-class projects that are changing the landscape of modern India.</p><p>&nbsp;</p>','2024-04-12 09:14:43.309000','2024-04-12 09:14:47.552000','2024-04-12 09:14:47.549000',2,2,'manyata-developers'),(71,'Classic Ventures','<p>Classic Ventures LLP is a three year old firm, and the Founding Partners are from Classic Property Developers with the expertise of nearly three decades and the Featherlite Group which has an impeccable legacy of 55 years in business. We promise to deliver a prestigious plotted development with clear titles, the best in class amenities, and constant upkeep and maintenance.</p><p>Classic Property Developers have been innovative leaders in the residential real estate industry with over 20 years of experience in plotted development solutions, and our unique talents allow us to consistently deliver top-quality projects. The Featherlite Group has been in the furniture business for more than 55 years and in real estate development for 10 years, and has a sterling reputation for quality, integrity and best business practices.</p><p>We have immense market knowledge and a stellar reputation in choosing the right land parcels, and for transforming them into an excellent investment opportunity. By providing world class amenities and tranquil spaces at reasonable rates, Classic Ventures LLP will provide top class villa plots for the discerning buyer looking for a place to build a home in a gated community, with a backbone of security and all essential services already in place.</p>','2024-04-12 11:02:06.293000','2024-04-12 11:02:08.826000','2024-04-12 11:02:08.821000',2,2,'classic-ventures'),(72,'Spectra Constructions','<p>A design-centric real estate company with a vast acumen in engineering, Spectra Constructions Pvt. Ltd. has developed premium residences across Bengaluru for over a decade. Leveraging our experience to create conscious architecture combined with a holistic design approach and a keen eye on detailing, the company has executed several prestigious projects.</p><p>Spectra projects are designed to keep the customer at the center of it all. We handpick locations surrounded by the best of living conveniences, create spaces with efficient planning, and implement it with skilled craftsmanship. Spectra homes seamlessly blend into your lifestyle creating happy memories, meant to be cherished for a lifetime.</p><p>Founded in 1999 as an engineering company, Spectra Constructions has evolved over the last couple of decades into a design-centric real estate company. With a background in infrastructure, since 2004, we have been designing and building premium homes in Bengaluru.</p><p>Every home, across our spectrum of projects, offers the perfect balance of comfort and luxury to our customers. Our commitment to serving, deep understanding of our customer needs, ethics, emphasis on forging a collective, and an inclusive community spirit has led to hundreds of satisfied customers.</p>','2024-04-15 09:26:34.461000','2024-04-15 09:26:38.629000','2024-04-15 09:26:38.626000',2,2,'spectra-constructions');
/*!40000 ALTER TABLE `builders` ENABLE KEYS */;
UNLOCK TABLES;

