INSERT INTO `components_property_facts_features` VALUES (20,'Akshaya Tango Features','<ul><li>Entrance Lobby</li><li>Paved Compound</li><li>Video Door Security</li><li>Library</li><li>Banquet Hall</li><li>Visitor Parking</li><li>Conference Room</li><li>Kid\'s Pool</li><li>Day Care Center</li><li>Yoga/Meditation Area</li><li>Gated Community</li><li>Landscape Garden and Tree Planting</li><li>Multipurpose Room</li><li>Power Backup</li><li>Ladies &amp; Gents Health Club</li></ul>'),(21,'Akshaya Tango Features','<ul><li>Entrance Lobby</li><li>Paved Compound</li><li>Video Door Security</li><li>Library</li><li>Banquet Hall</li><li>Visitor Parking</li><li>Conference Room</li><li>Kid\'s Pool</li><li>Day Care Center</li><li>Yoga/Meditation Area</li><li>Gated Community</li><li>Landscape Garden and Tree Planting</li><li>Multipurpose Room</li><li>Power Backup</li><li>Ladies &amp; Gents Health Club</li></ul>'),(67,'Structure','<p>Seismic-resistant RCC structure using system formwork with concrete walls in the main building &amp; RCC framed structure using concrete blocks for one Tower, basements, clubhouse &amp; other amenities.</p>'),(68,'Flooring','<p>Living, Dining, Kitchen, and Bedrooms: Flat Glazed Vitrified tiles.<br>Master Bedroom: laminated Wooden flooring.<br>Bathroom, Balcony &amp; Utility: Vitrified/Ceramic/wooden finish tiles.</p>'),(69,'Door, windows','<p>Main Door: Engineered wooden doors with a veneer finish.<br>Bedrooms, Toilet Doors: Engineered wooden doors with a laminate finish.<br>Windows: 3 track UPVC (Wooden finish laminated profile) Windows with Mosquito net.</p>'),(70,'Plumbing & sanitary','<p>Jaguar or equivalent water-efficient CP &amp; Sanitary fixtures.<br>Rainwater Harvesting drain pipes included.</p>'),(71,'Security','<p>3 Lifts of Suitable Size and Capacity in Every Block core.<br>Round-the-clock security with intercom facility.<br>CCTV Cameras at all vantage points.</p>'),(72,'Electrical','<p>Grid Power from BESCOM for each home.<br>Modular switches of reputed make.<br>Copper electrical wiring all throughout via concealed conduits.<br>DG Power backup: 50% of EB load for lighting circuits inside the apartments &amp; 100% backup for common area lighting, lifts, and utilities.</p>'),(73,'Structure','<p>Reinforced Cement Concrete (RCC) structure with Shear Walls by MIVAN formwork system</p>'),(74,'Flooring ','<p>Living, Dining, Bedroom, Utility, Kitchen: 600mm x 600mm Vitrified tiles<br>Bathrooms, Balcony: Anti-skid ceramic tiles.</p>'),(75,'Doors','<p>Main Door: 2100mm high wooden door frame and flush shutter with Veneer on both sides, finished with Melamine/PU polish coating<br>Internal Door: 2100mm high door frame and flush shutter with Laminate finish<br>Balcony Door: UPVC French door with plain glass sliding shutter<br>Windows: UPVC frames with plain glass sliding shutters with provision for Mosquito mesh</p>'),(76,'Plumbing and Sanitary','<p>Sanitary ware of Grohe, American Standard, or equivalent brand<br>CP fittings of Hindware or equivalent brand<br>Rainwater Harvesting drain pipes are included in Urbanrise The World of Joy Miyapur.</p>'),(77,'Security','<p>High-speed Automatic passenger lifts of Johnson/ Schindler / Thyssenkruppor equivalent<br>CCTV surveillance in the main entry and exit point; 3 cameras on each floor<br>Boom Barriers at the entry gateway for regulating access</p>'),(78,'Electrical','<p>3-phase Grid Power for each home.<br>Panasonic/Schneider/Legrand/MK Honeywell or equivalent Modular switches &amp; sockets<br>For flats, 100% metered DG backup and power supply<br>100% DG Backup for all common areas and 1 KVA backup for all flats</p>'),(79,'Infrastructure ','<p>Elevated Black Top Roads.<br>Curbs and sidewalks beside the roads in the project.</p>'),(80,'Security','<p>Elevated Compound Wall Along The Project Boundary.<br>24/7 security with CCTV surveillance at major vantage points.</p>'),(81,'Green features','<p>Themed Gardens, Extensively developed project-wide trees in parks and landscape development.<br>Avenue Trees On All Streets and internal roads.</p>'),(82,'Energy and powers','<p>Underground fiber optic provision for data, voice, and power lines to distribute power.<br>Energy-efficient Street lights all along the roads.</p>'),(83,'Plumbing and Water conservation','<p>Underground sanitary lines connected to STP.<br>Underground piped water lines.<br>Metro Water Provision For Individual Plots.<br>Recharge pit system for rainwater harvesting.</p>'),(84,'Structure','<p>RCC Framed Earthquake Resistant Structure.<br>Cement Blocks for All Walls Wherever Applicable.</p>'),(85,'Flooring','<p>Foyer, Living, Kitchen, Dining, Corridors, decks, Bedrooms.: Vitrified Tiles.<br>Toilets, Balcony, Utility: Anti-skid ceramic tiles.</p>'),(86,'Doors','<p>Main Door – Flush Doors with pre-engineered frames and all fittings.<br>Internal Doors – Flush Doors with pre-engineered frames and all fittings.<br>External Doors – UPVC Frames and Sliding Shutters.</p>'),(87,'Plumping and Sanitary ','<p>All CP fittings and Sanitaryware of premium quality from Jaquar / Hindware / Parryware or equivalent.<br>Wall mount cascade EWC in Master Bedroom Toilet and floor mounted in other toilets.<br>Rainwater Harvesting drain pipes included.</p>'),(88,'Security ','<p>Suitable Size and Capacity Passenger and Service Lifts in Every Block and Tower.<br>Round-the-clock security with intercom facility.<br>CCTV Camera at all vantage points.</p>'),(89,'Electrical','<p>3 KVA power for Studio, 1 BHK, 2 BHK, 5 KVA power for 2.5 BHK, Duplex, 3 BHK, and 8 KVA power for 4 BHK, Loft units.<br>Modular switches of reputed make.<br>Copper electrical wiring all throughout via concealed conduits.<br>100% Power backup for elevators, common areas &amp; pumps.</p>'),(90,'Structure','<p>Seismic zone II compliant RCC framed structure.<br>Masonry walls with concrete blocks.</p>'),(91,'Flooring','<p>Good quality vitrified tiles in the living, dining &amp; kitchen.<br>It has laminated wooden flooring in all bedrooms.<br>Ceramic tiles for balconies, utility areas &amp; toilets.</p>'),(92,'DOORS','<p>All doors with engineered door frames &amp; skin paneled shutters.<br>UPVC sliding doors with 3-track (one with mosquito mesh) for living room to balcony &amp; bedroom to balcony doors.<br>UPVC sliding windows with three tracks (one with mosquito mesh).</p>'),(93,'Plumbing and Sanitary','<p>White color EWC &amp; washbasin with granite countertop &amp; mirror for all toilets.<br>Toughened glass partition with an openable shutter in the master bedroom toilet.<br>Single lever mixer with shower rail &amp; hand shower for all showers and single lever mixer for all washbasins.<br>Premium quality Sanitaryware and CP Fittings.<br>Rainwater Harvesting drain pipes included.</p>'),(94,'Security','<p>2 Lifts of Suitable Size and Capacity Passenger in Every tower block.<br>Round-the-clock security with intercom facility.<br>Access controlled boom barriers.<br>CCTV Cameras at all vantage points.</p>'),(95,'Electrical','<p>Grid Power from BESCOM for each home.<br>Modular switches of reputed make.<br>Copper electrical wiring all throughout via concealed conduits.<br>100% Power backup for elevators, common areas &amp; pumps.</p>'),(96,'Infrastructure','<p>All roads in the project are 40ft and 60ft and are laid with asphalt.<br>Curbs and sidewalks beside the roads in the project.<br>Tree-lined avenues with pathways.</p>'),(97,'Security','<p>24/7 security with a grand entrance arch and boom barriers.<br>A peripheral boundary around the entire plotted development.<br>CCTV surveillance at all major vantage points.</p>'),(98,'Green features','<p>Multiple Extensive project-wide parks and landscape development with 4000+ trees.<br>Avenue plantation for all internal roads.</p>'),(99,'Energy and Power','<p>Underground fiber optic provision for data, voice, and power lines to distribute power.<br>Energy-efficient Street lights all along the internal roads.</p>'),(100,'Plumbing & Water Conservation','<p>Underground sanitary lines connected to STP.<br>Underground piped water lines.<br>Centralized overhead water tanks.<br>Recharge pit for rainwater harvesting.</p>'),(101,'Structure ','<p>RCC framed seismic compliant structure Building.<br>Concrete Solid Block Masonry.</p>'),(102,'Flooring','<p>Living, Bedrooms, Kitchen, Dining – Vitrified Tiles.<br>Master Bedroom – Wooden Laminate Floor.<br>Anti-skid Ceramic Tiles in Bathrooms and balconies.</p>'),(103,'Doors','<p>Main Door, Internal Doors – Hardwood frame with Flush door.<br>Bathrooms – Hardwood frame, hollow core flush shutter painted.<br>Windows – Glazed, UPVC frame with sliding shutter &amp; mosquito mesh.</p>'),(104,'Plumbing and Sanitary','<p>CP Fittings of Premium quality made with Shower Mixer.<br>Sanitary ware of Premium quality make.<br>Rainwater Harvesting drain pipes included.</p>'),(105,'Security','<p>Round-the-clock security with intercom facility.<br>CCTV Cameras at all vantage points.</p>'),(106,'Electrical','<p>Grid Power from BESCOM for each home.<br>Modular switches of reputed make.<br>Copper electrical wiring all throughout via concealed conduits.<br>100% Power backup for elevators, common areas &amp; pumps, and provisional backup for all units.</p>'),(107,'Structure','<p>RCC framed structure Building<br>Concrete Solid Block Masonry (Int &amp; Ext) – 200MM Exterior walls, 100MM Interior walls</p>'),(108,'Flooring ','<p>Vitrified tiles for living/dining/kitchen/bedrooms, &amp; utility area.<br>Ceramic tiles for the Bathrooms, balcony &amp; Master balcony.</p>'),(109,'DOORS & WINDOWS','<p>Main doors with wood finish frames and wood finish flush doors.<br>Other internal doors with wood finish frames and molded panel doors.<br>UPVC / Aluminum frames and sliding shutters for all sliding doors &amp; windows with mosquito mesh provision.</p>'),(110,'Plumbing and Sanitary','<p>Sanitaryware and CP fittings of reputed make.<br>Granite counter wash basin in the master toilet and wall-mounted wash basins in other toilets.<br>Rainwater Harvesting drain pipes included.</p>'),(111,'Security','<p>2 Automatic passenger lifts of 8 &amp; 13 passengers in each block/tower.<br>Round-the-clock security with intercom facility.<br>CCTV Camera at all vantage points</p>'),(112,'Electrical','<p>Premium Modular switches.<br>Copper electrical wiring throughout via concealed conduits.<br>2 &amp; 2.5 BHK: 4 KW BESCOM power single phase supply &amp; 0.75KW DG backup.<br>3 BHK: 5KW BESCOM power single phase supply &amp; 1 KW DG backup.<br>100% DG backup for pumps, lifts, and common areas..</p>'),(113,'Structure','<p>R.C.C. framed structure and solid cement blocks.<br>External and Internal walls of solid blocks.<br>&nbsp;</p>'),(114,'Flooring','<p>Quality finish vitrified tiles flooring for the Master Bedroom.<br>Vitrified floor tiles for Living, Dining, Family, Foyer, Bedrooms, and Kitchen.<br>Anti-skid finish tiles for Utility, Balcony &amp; Toilets.</p>'),(115,'Doors','<p>Main door – Timber wood frame with teak veneer flush shutters.<br>Other doors – Timber wood frames with flush shutters, branded hardware fittings specifications.<br>UPVC window with mosquito mesh provision and safety MS grills for windows.</p>'),(116,'Plumbing and Sanitary','<p>CP Fittings, Sanitary fittings of premium make.<br>Rainwater Harvesting drain pipes included.</p>'),(117,'Security ','<p>Two Passenger capacity lifts and One service lift per block, of a reputed brand.<br>Round-the-clock security with an intercom facility.<br>CCTV Cameras at all vantage points across the project.</p>'),(118,'Electrical','<p>3-phase grid power for all units.<br>FR-LSH (Fire Resistant Low Smoke Halogen) concealed copper wiring of Anchor or equivalent, modular switches, and sockets of Havells or equivalent.<br>BG backup for common area facilities and lighting. Provisional backup for all units.</p>'),(119,'Structure','<p>RCC Framed structure using Aluminium Form Work / Pre-cast Technology.<br>Concrete Solid Block Masonry for Exterior walls &amp; Interior walls.</p>'),(120,'Flooring','<p>Living / Dining / Family / Foyer / Kitchen: Vitrified Tiles.<br>Master Bedroom: Laminated Wooden Flooring.<br>Other Bedrooms: Vitrified Tiles.<br>Bathrooms: Ceramic Tiles.</p>'),(121,'Doors','<p>Main Door: Teakwood Frame With Design Shutter.<br>Internal doors: Pre-engineered frame with shutter.<br>Toilet Doors: Pre-engineered Frame With Shutter.</p>'),(122,'Plumbing and Sanitary','<p>CP Fittings: Kohler / Jaquar / Ess Ess Or Equivalent.<br>Granite Counter In Master Bedroom Bathroom.<br>Rainwater Harvesting drain pipes included.</p>'),(123,'Security','<p>Automatic passenger lifts are provided in each block with sufficient capacity and premium make.<br>Round-the-clock security with intercom facility.<br>CCTV Camera at all vantage points.</p>'),(124,'Electrical','<p>Grid Power from TNPL for all homes.<br>Modular switches: Anchor / Roma Or Equivalent premium make.<br>Copper electrical wiring all throughout via concealed conduits.<br>Power backup of 2KW for 2BHK, 3KW for 3 BHK homes.</p>'),(125,'Infrastructure','<p>Elevated Black Top Roads.<br>Curbs and sidewalks beside the roads in the project.</p>'),(126,'Security','<p>Elevated Compound Wall Along The Project Boundary.<br>24/7 security with CCTV surveillance at significant vantage points.</p>'),(127,'Green Features','<p>Themed Gardens, Extensively developed project-wide trees in parks and landscape development.<br>Avenue Trees On All Streets and internal roads.</p>'),(128,'Energy and Power','<p>Underground fiber optic provision for data, voice, and power lines to distribute power.<br>Energy-efficient Street lights all along the roads.</p>'),(129,'Plumbing & Water Conservation','<p>Underground sanitary lines connected to STP.<br>Underground piped water lines.<br>Metro Water Provision For Individual Plots.<br>Recharge pit system for rainwater harvesting.</p>'),(130,'Structure','<p>R.C.C Frame Structure.<br>Super Structure — R.C.C Shear Walls, Concrete Blocks for<br>non-structure elements.<br>Floor to Floor height of 3.6 Mts (12 ft).</p>'),(131,'Flooring','<p>Foyer, Living, Dining, Kitchen, Bedrooms – Imported Marble Flooring.<br>Master Bedroom &amp; Home Theatre – Wooden Finish Vitrified Tile/<br>Wooden Laminated Flooring.<br>Balconies – Vitrified Tiles.<br>All Toilets – Vitrified/Ceramic tiles and Dado up to False Ceiling Height.</p>'),(132,'Doors','<p>Entrance Door – 8 feet-high opening with hardwood frame and<br>flush shutter with both sides Veneer finish including Hinges, Lock, and Handle.<br>Bed Room &amp; Toilet Doors – 8 feet high opening with hardwood<br>frame and flush shutter with Taminate finish including Hinges, Lock, and Handle.<br>Balcony/Open Terrace Doors – Aluminum Double Glazed Sliding<br>with Mosquito Mesh.<br>Aluminum Double Glazed Sliding with Mosquito Mesh.</p>'),(133,'Plumbing and Sanitary','<p>Chromium-plated fittings of Kohler, TOTO, or equivalent make.<br>Hot &amp; Cold Wall Mixer for all Toilets.<br>European Water Closets.<br>Vanity Countertop Basin for Master Bedroom (Granite Counter).<br>Countertop Wash Basin for other Bedrooms.<br>Rainwater Harvesting drain pipes included.</p>'),(134,'Security','<p>Lifts of suitable size and capacity will be provided in all towers and private elevators in Fern Tower.<br>Round-the-clock security with intercom facility.<br>Round-the-clock CCTV Monitored Security Control System.</p>'),(135,'Electrical','<p>3-phase Grid Power for each home.<br>Centralized Air Conditioning System with Tap-off for each<br>apartment with BTU Meter.<br>Fire-Resistant Electrical Wire of reputed make.<br>Electrical Modular Switches of reputed make.<br>100% Power Backup for all common areas and for all apartments.</p>'),(136,'Structure','<p>RCC Framed structure using Aluminium Form Work / Pre-cast Technology.<br>Concrete Solid Block Masonry for Exterior walls &amp; Interior walls.</p>'),(137,'Flooring','<p>Premium Quality Vitrified Flooring in Living, Dining, Family, Foyer.<br>Premium Quality Vitrified Flooring in Bedrooms.<br>Anti Skid Ceramic Tiles in Bathrooms, Utility.</p>'),(138,'DOORS','<p>Main door – Flush shutter with both side Laminate and architrave.<br>Bedroom Doors – Engineered &amp; Treated Hard wood frame &amp; particle board with HDF skin and architrave.<br>Bathroom doors – Engineered &amp; Treated Hard wood frame, Shutter laminated both sides and architrave.<br>Windows – UPVC / Anodised Aluminium with mosquito mesh provision and safety grill.</p>'),(139,'Plumbing and Sanitary','<p><br>Premium branded CP fittings of Jaquar / Ess Ess / Essco or equivalent.<br>Sanitary Fittings of Floor mounted white EWC (Hindware / Parryware / Cera or equivalent) with exposed flush tank of standard make including health faucet.<br>Rainwater Harvesting drain pipes included.</p>'),(140,'Security','<p>Automatic passenger lifts are provided in each block with emergency phone facility connected to security cabin with D. G. backup.<br>Round the clock security with intercom facility.<br>CCTV Camera at all vantage points.</p>'),(141,'Electrical','<p>Grid Power from BESCOM for each home.<br>Premium Modular switches of Anchor or equivalent.<br>Copper electrical wiring all throughout via concealed conduits.<br>100 percent D.G. back-up for common area lighting, pumps, and lifts.</p>'),(142,'Structure','<p>Seismic Zone 2 compliant RCC framed structure Building.<br>Concrete Solid Block Masonry (Int &amp; Ext) – 200MM Exterior walls, 100MM Interior walls.</p>'),(143,'Flooring ','<p>Premium vitrified tile flooring in the Foyer, Living, Dining, Corridors, and all Bedrooms.<br>Anti-skid Ceramic Tiles in Balconies, Bathrooms.</p>'),(144,'DOORS','<p>All doors are made of engineered wooden door frames &amp; shutters.<br>UPVC sliding doors with mosquito mesh for Living to Balcony and Bedroom to Balcony.<br>Windows – UPVC sliding windows with mosquito mesh.</p>'),(145,'Plumbing and Sanitary ','<p>All Toilets will have EWCs, Sanitary ware, and Chrome Plated Fittings of reputed make.