ic door lock Dorma / Dorset or equivalent.<br>UPVC Windows with bug mesh will be provided inside the apartments. Window safety grills will be provided for all the sliding windows inside the apartment.</p>'),(348,'Plumbing and Sanitary','<p>All internal plumbing lines are CPVC &amp; external plumbing in UPVC/PVC pipes.<br>CP fittings: JAQUAR / ROCA or equivalent will be provided.<br>Sanitary Fittings: JAQUAR / AMERICAN STANDARD or equivalent will be provided.<br>Rainwater Harvesting drain pipes included.</p>'),(349,'Security','<p>13 Passenger stretcher lift Schindler/ FUJITEC or equivalent will be provided.<br>A new generation digital lock system and Stand-alone Video Door Phone (VDP) will be provided for each apartment.<br>24 x 7 CCTV surveillance camera for basement, stilt, entry &amp; exit.</p>'),(350,'Electrical','<p>3 Phase connection for each apartment.<br>Modular Switches and sockets will be of Panasonic / L &amp; T / MK or equivalent.<br>Fire Retardant Low Smoke (FRLS) copper wire of a quality ISI brand KEI/Havel’s/Polycab/equivalent.<br>Power backup: 600W for 2BHK &amp; 2.5BHK, 800W for 3BHK, 1000W for 3.5BHK.</p>'),(351,'Structure','<p>RCC framed Building.<br>Unique skyline structure.<br>Concrete Solid Block Masonry (Int &amp; Ext) – 200MM Exterior walls, 100MM Interior walls.</p>'),(352,'Flooring','<p>Vitrified tile / Marble flooring for Foyer, Living, Dining, Corridors, and all Bedrooms.<br>Plastic emulsion paint for walls and ceiling.<br>Anti Skid Ceramic Tile flooring in bathrooms.</p>'),(353,'Doors','<p>European Imported door for Main Door – 8 Feet High Opening with Pre-Moulded Flush Shutter &amp; Frame in Wood and Polish on Both Sides.<br>Internal Doors – 7 Feet High Opening with Wooden Frames and Flush Shutters.<br>External Doors – Windows with UPVC Frames and Sliding Shutters.</p>'),(354,'Plumbing and Sanitary','<p>All Toilets will have EWCs and Chrome Plated Fittings of Jaquar or equivalent water-efficient make.<br>Granite Counter with Ceramic Wash