ights on MS poles.</p>'),(792,'Security','<p>24/7 security with RFID boom barriers.<br>Boundary walls in masonry or concrete to a height of 1.8m.<br>CCTV surveillance at all major vantage points.</p>'),(793,'Green Features','<p>Extensive project-wide parks and landscape development with a central boulevard and over 8 acres of eucalyptus forest.<br>Combination of trees, shrubs, and creepers based on the theme of the project.</p>'),(794,'Energy and Power','<p>Power connection of 4 kVA for each plot of up to 2,500 sq.ft. and 5kVA for plots larger than 2,500 sq.ft.<br>Underground power lines to distribute power through feeder pillar.</p>'),(795,'Plumbing & Water Conservation','<p>Water supply shall be through a combination of overhead storage with gravity distribution and a hydropneumatic pump system.<br>Percolation pits shall be provided at regular intervals within the stormwater drainage system.<br>A tertiary sewage treatment plant shall be provided with separate plumbing for the use of recycled water in landscaping.</p>'),(796,'Structure','<p>RCC framed Building Structure.<br>Concrete Solid Block Masonry for Exterior and Interior walls (Wherever applicable).</p>'),(797,'Flooring','<p>Vitrified tile in the Foyer, Living, Dining, and Corridors.<br>Laminated Wooden Flooring in Bedrooms.<br>External grade wooden flooring in Balconies.<br>Anti-skid ceramic tiles for all bathrooms, utility, and common areas.</p>'),(798,'Doors','<p>Main Door – 8 Feet High Opening with Pre-Moulded Flush Shutter &amp; Frame in Wood and Polish on Both Sides.<br>Internal Doors – 7 Feet High Opening with Wooden Frames and Flush Shutters.<br>External Windows – UPVC Frames and Sliding Shutters.</p>'),(799,'Plumbing & Sanitary','<p>All Toilets will have EWCs and Chrome Plated Fittings.<br>Chrome Plated Tap with Shower Mixer.<br>Granite Counter with Ceramic Wash Basin in the Master Toilet and Pedestal Wash Basins in Other Toilets.<br>Rainwater Harvesting drain pipes included.</p>'),(800,'Security','<p>Suitable Size and Capacity Passenger and Service Lifts in Every Block.<br>Round-the-clock security with intercom facility.<br>CCTV Cameras at all vantage points.</p>'),(801,'Electrical','<p>Grid Power from BESCOM for each home.<br>Modular switches of reputed make.<br>Concealed Wiring with PVC Insulated Copper Wires and Modular Switches.<br>100% Power backup for Apartments, Elevators, common areas &amp; pumps.</p>'),(802,'Structure','<p>RCC framed structure Building.<br>Concrete Solid Block Masonry (Int &amp; Ext) – 200MM Exterior walls, 100MM Interior walls.</p>'),(803,'Flooring','<p>Vitrified tiled flooring in the Foyer, Living, Dining, Corridors, and all Bedrooms.<br>Anti-skid Ceramic Tiles in Bathrooms and balconies.</p>'),(804,'Doors','<p>Main Door – 8 Feet High Opening with Pre-Moulded Flush Shutter and Frame in Wood and Polish on Both Sides.<br>Internal Doors – 7 Feet High Opening with Wooden Frames and Flush Shutters.<br>External Doors – UPVC Frames and Sliding Shutters.</p>'),(805,'Plumbing & Sanitary','<p>All Toilets will have EWCs and Chrome Plated Fittings.<br>Chrome Plated Tap with Shower Mixer.<br>Granite Counter with Ceramic Wash Basin in the Master Toilet and Pedestal Wash Basins in Other Toilets.<br>Rainwater Harvesting drain pipes included.</p>'),(806,'Security','<p>Suitable Size and Capacity Passenger and Service Lifts in Every Block.<br>Round-the-clock security with intercom facility.<br>CCTV Camera at all vantage points.</p>'),(807,'Electrical','<p>Grid Power from BESCOM for each home.<br>Designer Modular switches of reputed make.<br>Copper electrical wiring throughout via concealed conduits.<br>100% Power backup for elevators, common areas &amp; pumps.</p>'),(808,'Structure','<p>RCC framed structure Building.<br>Concrete Solid Block Masonry (Int &amp; Ext) – 200MM Exterior walls, 100MM Interior walls.</p>'),(809,'Flooring','<p>Vitrified tiled flooring in the Foyer, Living, Dining, Corridors, and all Bedrooms.<br>Anti-skid Ceramic Tiles in Bathrooms and balconies.</p>'),(810,'Doors','<p>Main Door – 8 Feet High Opening with Pre-Moulded Flush Shutter and Frame in Wood and Polish on Both Sides.<br>Internal Doors – 7 Feet High Opening with Wooden Frames and Flush Shutters.<br>External Doors – UPVC Frames and Sliding Shutters.</p>'),(811,'Plumbing and Sanitary','<p>All Toilets will have EWCs and Chrome Plated Fittings.<br>Chrome Plated Tap with Shower Mixer.<br>Granite Counter with Ceramic Wash Basin in the Master Toilet and Pedestal Wash Basins in Other Toilets.<br>Rainwater Harvesting drain pipes included.</p>'),(812,'Security','<p>Suitable Size and Capacity Passenger and Service Lifts in Every Block.<br>Round-the-clock security with intercom facility.<br>CCTV Camera at all vantage points.</p>'),(813,'Electrical','<p>Grid Power from BESCOM for each home.<br>Designer Modular switches of reputed make.<br>Copper electrical wiring throughout via concealed conduits.<br>100% Power backup for elevators, common areas &amp; pumps.</p>'),(814,'Structure','<p>Seismic-11 zone compliant RCC Framed structure.<br>Solid concrete block masonry.</p>'),(815,'Flooring','<p>AC-4 grade Laminated Wooden flooring for the main Bedroom.<br>Vitrified flooring &amp; skirting for living, dining, kitchen, and bedrooms.<br>Superior quality anti-skid ceramic tile flooring &amp; skirting for balconies and utility.<br>Superior quality anti-skid ceramic tiles for toilets.</p>'),(816,'Doors','<p>Main Door: Seasoned hardwood door frames/ Engineered wood frames with Laminated engineered flush shutters.<br>Bedroom &amp;Toilet doors: Engineered door frames with laminated engineered flush shutter.<br>1.5 BHK: Toilets &amp; Bath doors will be Aluminum/ PVC/ FRP frames with shutters.<br>Balcony Doors: Powder-coated aluminum / UPVC sliding / openable door.<br>Main door with digital lock, rim lock, and night latch. Bedroom doors with mortise lock.<br>Sliding Windows: Heavy-duty powder-coated aluminum/UPVC Modular windows with mosquito mesh shutter.</p>'),(817,'Plumbing & Sanitary','<p>White sanitary ware of Cera/Kohler/Roca/Jaquar or equivalent make in the toilets.<br>Wall-mounted commodes.<br>Counter-type wash basin with basin mixer in all the bathrooms.<br>Hot and cold mixer of Jaquar/Kohler/Roca or equivalent make in all toilets.</p>'),(818,'Security','<p>Suitable Size and Capacity Passenger and Service Lifts in Every Block.<br>Round-the-clock security with intercom facility.<br>CCTV Camera at all vantage points.</p>'),(819,'Electrical','<p>Fire retardant electric wires of Havells/Lap/RR Kabel/Polycab or equivalent make.<br>Modular electrical switches of reputed Brand.<br>Video Door Phone for all apartments.<br>Grid Power from BESCOM of 2.5 KW for 1 &amp; 1.5 BHK, 4 KW for 2 &amp; 2.5 BHK, 5 KW for 3 &amp; 3.5 BHK, and 6 KW for 4 BHK shall be provided for apartments.<br>DG backup power of 0.5 KVA for 1 &amp; 1.5 BHK, 1 KVA for 2 &amp; 2.5 BHK, 1.5 KVA for 3 &amp; 3.5 BHK, and 2 KVA for 4 BHK shall be provided.</p>'),(820,'Infrastructure','<p>12 m wide internal road laid with Asphalt for the driveway.<br>Strom water gutter drains along the driveway.<br>Curbs and sidewalks beside the roads in the project.</p>'),(821,'Security','<p>24/7 security with RFID boom barriers.<br>A peripheral boundary around the entire Orchards Plots project.<br>CCTV surveillance at all major vantage points.</p>'),(822,'Green Feautures','<p>Extensive project-wide parks and landscaped development with gardens housing 6-7 varieties of orchards.<br>Avenue plantation for internal roads along the sides of the roads.</p>'),(823,'Energy & Power','<p>100% DG backup for the common service areas<br>Underground power lines to distribute power through feeder pillar.<br>Provision to lay cable lines from feeder pillars to individual plots.<br>Energy efficient fixture for common service areas with Timer adjusted streetlights.</p>'),(824,'Plumbing & Water Conservation','<p>Underground sanitary lines connected to STP.<br>Underground piped water lines.<br>Primary water treatment plant and sewage treatment plant in the project.<br>Centralized overhead water tanks.<br>Recharge pit for rainwater harvesting.<br>&nbsp;</p>'),(825,'Structure','<p>RCC framed structure Building.<br>Concrete Solid Block Masonry (Int &amp; Ext) – 200MM Exterior walls, 100MM Interior walls.</p>'),(826,'Flooring','<p>Vitrified Flooring in the Living, Dining, and Foyer areas.<br>Wooden laminate flooring for master bedrooms.<br>Anti-skid ceramic Tile flooring for toilets, interior staircases, and balconies.</p>'),(827,'Doors','<p>Main door – Engineered door frame with veneer finished shutter with good quality hardware and security eye.<br>Bathroom doors – High Standard door frame with a shutter of veneer finish outside and laminated finish inside with good quality hinges and thumb-turn lock.</p>'),(828,'Plumbing & Sanitary','<p>Premium branded CP fittings and sanitaryware for all bathrooms.<br>Rainwater Harvesting drain pipes included.</p>'),(829,'Security','<p>Gated community with Round-the-clock security with an intercom facility.<br>CCTV Camera at all vantage points.</p>'),(830,'Electrical','<p>Grid Power from BESCOM for each home.<br>Premium Modular switches of reputed brands.<br>Copper electrical wiring throughout via concealed conduits.<br>100% power backup for common area lighting, pumps, and amenities.</p>'),(831,'Structure','<p>Seismic zone II compliant RCC framed structure.<br>Masonry walls with concrete blocks.</p>'),(832,'Flooring','<p>Good quality vitrified tiles in the living, dining &amp; kitchen.<br>It has laminated wooden flooring in all bedrooms.<br>Ceramic tiles for balconies, utility areas &amp; toilets.</p>'),(833,'Doors','<p>All doors with engineered door frames &amp; skin paneled shutters.<br>UPVC sliding doors with 3-track (one with mosquito mesh) for living room to balcony &amp; bedroom to balcony doors.<br>UPVC sliding windows with three tracks (one with mosquito mesh).</p>'),(834,'Plumbing & Sanitary','<p>White color EWC &amp; washbasin with granite countertop &amp; mirror for all toilets.<br>Toughened glass partition with an openable shutter in the master bedroom toilet.<br>Single lever mixer with shower rail &amp; hand shower for all showers and single lever mixer for all washbasins.<br>Premium quality Sanitaryware and CP Fittings.<br>Rainwater Harvesting drain pipes included.</p>'),(835,'Security','<p>2 Lifts of Suitable Size and Capacity Passenger in Every tower block.<br>Round-the-clock security with intercom facility.<br>Access controlled boom barriers.<br>CCTV Cameras at all vantage points.</p>'),(836,'Electrical','<p>Grid Power from BESCOM for each home.<br>Modular switches of reputed make.<br>Copper electrical wiring all throughout via concealed conduits.<br>100% Power backup for elevators, common areas &amp; pumps.</p>'),(837,'Structure','<p>RCC Framed Structure with Solid Blocks for wall masonry.<br>External walls are 6” thick &amp; internal walls of 4” thick.</p>'),(838,'Flooring','<p>Laminated AC4 Grade Wooden Flooring for Master Bedroom.<br>Imported Marble flooring in the living room and dining.<br>Matt Finish Tiles for kitchen.<br>IS Standard tiles (600×1200) in all bedrooms.<br>IS Standard antiskid tiles for bathroom and balcony flooring.</p>'),(839,'Doors','<p>Solid Teak Wooden door frame and door shutter with melamine polishing.<br>Digital Smart Lock for Main door and Silent Lock for other doors along with SS finish fittings (Hinges, Latches &amp; Handles).<br>Acacia/Sal wood door frame with molded panel door fitted with a lock to all Bedrooms.<br>Acacia/Sal wood door frame and door shutters for Bathrooms.<br>Aluminum windows with grills and Mosquito mesh.</p>'),(840,'Plumbing & Sanitary','<p>Villeroy &amp; Boch/Kohler/Grohe/American Standard/equivalent make of CP fittings and accessories of good quality general range in all bathrooms.<br>Concealed CPVC Plumbing lines for Hot and cold water lines in all toilets.<br>Rainwater Harvesting drain pipes included.</p>