ified tiles.<br>Master Bedroom, Other Bedrooms – Laminated wooden flooring.</p>'),(851,'Doors','<p>Main Door: Wooden frame with teak finish (Height: 8’), Flush door with veneer finish on both sides, Architrave on both sides.<br>Internal Doors: RCC frame, Flush door with veneer finish on the outside and painted on the inside, Architrave on both sides, Flush to outside face with wooden beading.<br>Windows: UPVC/Aluminium with 3-track mosquito mesh.</p>'),(852,'Plumbing and Sanitary	','<p>Chromium-plated fittings.<br>Hot and cold wall mixer for all the toilets.<br>European Water Closet (EWC) with Health faucet for all the toilets.<br>Washbasin in all toilets.<br>Shower partitions are provided in all toilets.</p>'),(853,'Security','<p>Round-the-clock security with intercom facility.<br>Boundry perimeter wall for the entire project.<br>CCTV cameras at high-traffic Entry and exit points.</p>'),(854,'Electrical	','<p>BESCOM power supply: 10KVA 3-phase supply for all row houses.<br>3KVA power backup for row houses and 100% power backup for common area facilities.<br>TV and AC points in the Living Room, Master bedroom &amp; other Bedrooms.<br>&nbsp;</p>'),(855,'Infrastructures','<p>12m wide internal road laid with asphalt for the driveway.<br>9m wide internal road laid with asphalt for the driveway.<br>Landscaped avenue plantation on either side of the road.<br>Concrete perforated slabs on pedestrian pathways along the road.<br>Stormwater gutter drain along the driveway.</p>'),(856,'Security','<p>24/7 security with boom barriers at entry/exit gates.<br>A peripheral boundary around the entire project<br>Individual street security with cameras at all major vantage points.</p>'),(857,'Green Feautures','<p>Urban garden areas across the project area with Sustainable trees for each plot.<br>Avenue plantation for internal and public roads.<br>Low maintenance plants on either side of the road.</p>'),(858,'Energy and Powe','<p>100% DG back up for the common service areas.<br>Underground fiber optic provision for data, voice, and power lines to distribute power through feeder pillar.<br>Provision to lay cable lines from feeder pillars to individual plots.<br>Energy-efficient fixtures for common service areas with Timer adjusted streetlights.<br>Clubhouse roof design – more natural ventilation, reduced energy costs.</p>'),(859,'Plumbing & Water Conservation','<p>Underground sanitary lines connected to STP.<br>Underground piped water lines.<br>Irrigation network for garden areas with Treated water used for landscape irrigation and Drip irrigation for garden areas.<br>Recharge pit for rainwater harvesting.</p>'),(860,'Infrastructure','<p>Good Quality Asphalted roads with curbs and culverts.<br>Paved pedestrian paths with trees/Shrubs on both sides of the road.<br>Road and plot signage for the entire layout.</p>'),(861,'Security','<p>Elevated Compound Wall Along The Project Boundary.<br>24/7 security with CCTV surveillance at major vantage points.</p>'),(862,'Green Features','<p>Well-designed landscaped Parks, Streetscapes, and open spaces in over 10 acres of land.<br>Avenue Trees On All Streets and Internal Roads.</p>'),(863,'Energy and Power','<p>Underground cabling network in the layout with power cable terminated at each plot.<br>Streetlights across the layout as per design.<br>Network of piping to accommodate voice and data cables.</p>'),(864,'Plumbing & Water Conservation','<p>Underground Sump Tank for raw water and treated water storage.<br>Overhead Tank – for water supply to each plot through the pipe network – capacity as per design.<br>Sewage treatment plant.<br>Rainwater harvesting pits at locations as per design.<br>Double-wall corrugated pipe network along the road to drain off the stormwater.<br>Borewells (if required and permitted) for the entire layout of the water source.<br>Municipal supply line from the entrance to the UG sump.<br>&nbsp;</p>');
